INSERT INTO `hexagram` VALUES (1,'Force','Draw on your inner power and don’t pause. Create inspiration for others.  Be enduring. Take the lead. Beware of using old ideas. Take immediate creative action.','The primal spirit power that both creates and destroys. Dynamic, unwearied persisting.','Dragon','Dragon'),(2,'Field','Help everything emerge and flourish. Do not take the lead. Beware of aggression, seizing the initiative, and personal ambition. Follow the lead and integrate resources.','The primal structuring power confronted with many forces and obstacles. Giving way in order to serve and yield results.','Field','Field'),(3,'Sprouting','Rouse people’s creative energy. Don’t try to control the process. Connect the various groups involved clearly. Beware of pushing forward alone or over-reacting to opportunities. Practice restraint. Establish stability before making decisions.','Beginning growth. Collecting potential in preparation for arduous labor.','Ghost River','Thunder'),(4,'Enveloping','Nurture hidden growth. Protect the beginnings. Don’t try to stir things up. Beware of insincerity, laziness and misunderstanding. Focus on hard work, self-discipline, receptivity to good advice.','Concealment and clouded awareness. Actively accepting this concealment in order to nurture growth.','Mountain','Ghost River'),(5,'Attending','Attend to what is needed and wait for the right moment to act. Enjoy things with others. Don’t push yourself forward. Beware of wasting or misdirecting resources, impatience, and greed. Relax, persevere and trust yourself.','Being compelled to wait for and serve something. Fixing your attention on what is required while waiting carefully for the right moment to act.','Ghost River','Dragon'),(6,'Arguing','Retreat from conflict and seek a real judgment. Use persuasive words, not action. Arouse the desire to serve. Beware of aggression, greed and insistence on your own point of view. Use conciliation and self-reflection to defuse possible conflicts.','A dispute. Actively expressing your claims and objections.','Dragon','Ghost River'),(7,'Legions','Build cohesiveness, instruct people, mobilize energy and take the lead. Inspire your family. Gain their support.  Beware of inept strategy and poor coordination. Make efficient and economic use of resources in an atmosphere of trust and confidence.','Unorganized crowds or bunches of things. Organizing these things into functional units.','Field','Ghost River'),(8,'Grouping','Reorganize yourself. Find new allies and strategies. Empower others to help you. Beware of creative misjudgment and lack of perseverance. Rely on a sound principle idea. Be a committed leader with a strong vocation that others see and trust.','How you categorize people and things and how you relate to these categories. Joining people and things through recognizing their essential qualities.','Ghost River','Field'),(9,'Small Accumulates','Pay careful attention to details. Don’t be impetuous. Bring out the innate value of each thing and help it. Beware of being brusque, challenging or impatient. Keep yourself occupied in positive ways. Do not waste time on irritating people.','A variety of seemingly unconnected events and impulses. Retaining and hoarding these experiences through adapting to them.','Penetrating','Dragon'),(10,'Treading','Be clear about who is above you and who is under you. Find a common purpose. Don’t be humble. Beware of obsequiousness, sycophancy, intolerance and greed. Be on your best behavior but do not compromise your principles.','Finding and making your way. Doing this step by step.','Dragon','Lake'),(11,'Pervading','This is a time of peace, harmony and spreading abundance. Offer what you have to your highest ideals. Don’t pull back. Beware of greed, malice and mean-spirited actions. Follow the natural cycles with gratitude and the blessings will flow.','Prospering and expanding. Continually spreading this prosperity through communicating.','Field','Dragon'),(12,'Obstruction','The struggle you face can only be resolved by inner work. Use your power carefully. Don’t accept gifts. Stay in hiding. Beware of yielding to temptations that contain hidden agendas. Avoid making obvious mistakes by showing strength of character. Do not compromise principles.','Being blocked or interfered with. Accepting the hindrances that temporarily interrupt the flow of life and thwart communication.','Dragon','Field'),(13,'Harmonizing People','Synchronize goals, ideas and resources. Sort out the different groups and brighten their understanding of each other. Beware of secrecy and rejecting new ideas. Create an organized structure where people can maximize creative ability and open a context for dissemination and realization of ideas.','Sharing a goal with others. Finding ways to cooperate with and harmonize people\'s efforts.','Dragon','Radiance'),(14,'Great Being','Concentrate on one inspiring goal and share your success. Get rid of negative feelings and release the new energy. Beware of abusing your advantageous position; greed, secrecy, selfishness. Make productive use of this extraordinary time.','Your relation to an overriding concern or central idea. Organizing all your efforts around this idea.','Radiance','Dragon'),(15,'Humbling','Balance and adjust things by cutting through pride and complication.  Reduce what is overdeveloped. Don’t try to advance yourself. Beware of conceit and arrogance. Be consistent and resilient. Don’t follow policy, do the right thing.','The necessity to cut through pride and complication. Keeping your words unpretentious.','Field','Mountain'),(16,'Providing for','Collect what you need to meet the future joyously. Rouse people’s Idealism.Don’t get caught in the details. Beware of negative feedback that damps spirit and enthusiasm. Create a harmonious and enthusiastic environment that brings out creative energy; open exchange, positive feedback.','What is needed to meet the future. Accumulating strength through foresight and prudence so things can be fully enjoyed.','Thunder','Field'),(17,'Following','Return to your flow and let it move you. Gather the inner energy. Don’t take on corruption and wrongdoing. Beware of manipulating people for selfish ends. Use your ideas for the good of all involved.','Being impelled or drawn into moving forward. Yielding to the impulse by accepting guidance.','Lake','Thunder'),(18,'Corruption / Renovating','Eliminate corruption at the source. Clear the channels. Rouse and inspire the group. Don’t just let things go. Beware of laziness, attachment to the past, a false position of power. Use energy, insight, commitment and hard work.','Disorder, perversion and putrefaction. Letting things rot away so they become obsolete.','Mountain','Penetrating'),(19,'Nearing','Something important is coming. Think things over very carefully and teach others. Don’t pull back. Beware of over-caution, negativity and fear. Be active, communicate and work hard.','Approaching and being approached. Acting without immediately expecting to attain what you desire.','Field','Lake'),(20,'Viewing','Let everything come into view. Watch the signs and connect to the common good. Cultivate learning and development among all. Beware of failing to recognize patterns, ignoring landmarks, forgetfulness and lack of attention to detail. Commit to flexible long term planning.','Something seen from a distance, out of immediate reach. Carefully observing and divining the meaning.','Penetrating','Field'),(21,'Biting Through','Confront problems. Bite through obstacles. Use severe measures to clarify what is right. Don’t cover things up. Beware of inaccuracy, delay, not probing deeply. Cooperate fully with authorities. Make clear, quick and incisive judgments.','Confronting a tenacious obstacle. Biting through and picking things clean until the essential is revealed.','Radiance','Thunder'),(22,'Adorning','Let outer appearance reflect inner worth. Brighten people’s understanding. Don’t be severe or confine your feelings. Beware of confusing ideas and hasty plans. Create an atmosphere in which agreement can occur. Emphasize beauty, color, attractiveness, culture.','Outward presentation. Building intrinsic value by embellishing appearance and displaying valor.','Mountain','Radiance'),(23,'Stripping','Eliminate old habits, patterns and structures. Use your power quietly and be generous with those who look to you for leadership. Beware of seeking personal gain or insisting on control. Adapt to the time by giving up personal desires and supporting those who look up to you.','Something outmoded or worn out. Eliminating what has become unusable.','Mountain','Field'),(24,'Returning','Renew and renovate things. Re-establish relations. Don’t leave your secure place for now. Beware of aggression and pushing plans to premature completion. Be gentle and supportive. Explore new ideas.','Something that is re-emerging. Going back to the starting point in order to begin anew.','Field','Thunder'),(25,'Disentangling','Use the great potential of this time to nourish everything involved. Don’t try to advance yourself. Beware of secret designs and seeking personal advantage. Use ideas that come naturally, inspired by a positive attitude towards others.','Being without confusion or fault. Acting while remaining free from entangling, vanity or recklessness.','Dragon','Thunder'),(26,'Great Accumulates','Focus on one central plan. Use the wisdom of the past to nurture your inner power. Don’t try to start something new yet. Beware of erratic lifestyle, emotional swings and shifting ideals. Be consistent and focus on high personal ideals.','An overriding concern that defines what is valuable. Bringing the variety of things under the control of this central idea.','Mountain','Dragon'),(27,'Jaws / Nourishing','Consider your words carefully and use them to bring people together. Don’t go on alone. Beware of hesitation, lack of imagination, failure to use creative input. Seek creative balance and enhanced scope to meet basic needs.','Nourishing and being nourished. Opening in order to take things in as well as providing to others.','Mountain','Thunder'),(28,'Great Transition','This is a critical passage, a moment of truth. Stand alone without fear. Step out of conventional ideas. The channels are open. Beware of laziness and adherence to old values under pressure. Implement your highest values and stand by them.','Your connection to a ruling principle. Pushing the guiding idea beyond ordinary limits and accepting the results.','Lake','Penetrating'),(29,'Ghost River / Navigator','Listen to what is hidden. Face the challenge yourself. Do not try to take the lead. Beware of impulsiveness, lack of planning and mistrust. Be committed. The natural skill is there. Believe in it.','A dangerous situation you cannot avoid. Taking the risk without reserve.','Ghost River','Ghost River'),(30,'Radiance / Visionary','Discriminate, articulate and join things to reveal new possibilities. Let go of the past and brighten all that is hidden. Beware of irregular pacing, using resources carelessly, failure to develop inner potentials. Acknowledge the sources of energy. Take care of your base and it will take care of you.','Expanding light, warmth and awareness. Joining with and depending on what spreads this light.','Radiance','Radiance'),(31,'Conjoining','Connect what belongs together. Don’t diminish your involvements. Get rid of personal ambition and accept all the people. Beware of bigotry, prejudice, small-mindedness. Be original and let the unexpected play a prominent part. Give credit where credit is due.','The influence that separated parts of an intrinsic whole have on each other. Bringing these parts into contact.','Lake','Mountain'),(32,'Persevering','Create goals that help everyone endure in what is right. Don’t increase your involvements. Establish firm borders. Beware of distractions, erratic shifts, isolation. Continue to do what you do best. Have confidence.','Continuity and endurance. Continuing on and renewing the way you are following.','Thunder','Penetrating'),(33,'Retiring / Retreat','Retire from normal activities to gather inner power. Keep what is small at a distance. Don’t be a follower or try to create a following. Beware of hesitation, failure to make plans, dislike and aggression. Be flexible. Give ground but preserve resources.','Conflict and consequent seclusion. Withdrawing from the affairs at hand to conceal yourself in obscurity.','Dragon','Mountain'),(34,'Great Invigorating','Develop the strength of your central idea. Don’t just look at things. Step outside the rules and press forward. Beware of procrastination, trusting the wrong people, oppressive authority. Actively pursue worthy goals.','The invigorating power of a central creative idea. Animating everything around you through this guiding motivation.','Thunder','Dragon'),(35,'Flourishing','Use your deep power to brighten your work and your purpose. Don’t just wait for the right moment. Act now. Beware of personal greed and selfish aims. Develop new creative ideas without immediate regard for gain.','Thriving in the full light of the sun. Contributing to this increase by helping things to flourish.','Radiance','Field'),(36,'Hiding Brightness','Hide your light, accept the difficulties and find the hidden beginnings. Don’t appeal to authority. Supervise things from hiding. Beware of pushing yourself forward, being incautious or responding to provocation or temptation. Preserve inner calm and inner development. Take no risks.','Intelligence hidden or harmed. Deliberately concealing your light by entering what is beneath you.','Field','Radiance'),(37,'Dwelling People','Nourish the people you live and work with. Use your words to inspire them and your actions to connect them. The struggle is not over yet. Beware of indifference to human bonds, oppressive authority and failure to set a real example. Forge ties based on shared human values.','Living and working with others in a common space. Caring for your relation with those who share this space and for the space itself.','Penetrating','Radiance'),(38,'Diverging','Step outside the norms and re-imagine the situation. Actively reconcile conflicts. Bring out the hidden agendas. Beware of imposing ideas; attempting to take immediate material advantage, need for direct control. Be prepared to learn something valuable.','Things that are connected but should not join. Putting things in opposition while acknowledging their essential link.','Radiance','Lake'),(39,'Limping / Difficulties','Don’t be a hero. Join with others and re-imagine the situation. Reverse direction and renovate your inner power. Beware of narrow-minded attitudes and egocentricity. Be humble, find help and change your basic attitudes.','Being weak, afflicted or hampered. Going ahead even though haltingly. (Sic)','Ghost River','Mountain'),(40,'Deliverance / Liberating','Solve problems, untie knots, dispel bad feelings and liberate blocked energy. Don’t go back to the security of your old group. Beware of dwelling on the past, holding grudges, wasting energy. Complete unfinished work and stabilize the situation in an optimistic, calm and equitable way.','Reflection and release from tension. Analyzing and understanding things in order to be delivered from compulsion.','Thunder','Ghost River'),(41,'Diminishing','Decrease greedy desires and aim at a higher goal. Curb anger and passion. Do not be carried away. Beware of showing off, stealing, greed and unjust use of resources. Be simple, sincere and transparent.','Sacrifice and loss. Lessening yourself and decreasing your involvements.','Mountain','Lake'),(42,'Augmenting','Pour energy into all your endeavours. Don’t go on in the old ways. Visualize improvement and shift your position. Diminish what is too much. Beware of selfishness, withholding and failure to nourish and repay. Build resources, replenish the whole.','Increase and advance. Expanding the quantity and quality of your involvement.','Penetrating','Thunder'),(43,'Deciding / Breakthrough','Make a decision and announce it to all. Keep your integrity, act decisively and spread the benefits. Beware of lack of resolution and selfish hoarding. Make a firm decision to act on sound plans that mean more than personal gain.','Separation and diverging directions. Resolutely dividing your energies.','Lake','Dragon'),(44,'Coupling','Embrace new ideas and welcome new encounters. Spread the new to all. Don’t let your ambition get in the way. Beware of misplaced trust, divisive influences and personal advantage. Organize events creatively and let others carry them into effect.','The encounter of primal energies. Seeing-through your personal situation as the connection of objective forces.','Dragon','Penetrating'),(45,'Gathering','Don’t keep things for yourself. Take precautions and eliminate cause of conflict. Beware of divisive tendencies, envious or jealous behavior, selfish motivations. Cooperate with others on all levels.','Collecting and assembling. Bringing people and things together through a common feeling or goal.','Lake','Field'),(46,'Ascending','Rise to a higher level through your own efforts. Wiggle your way out of old entanglements. Gather the small to achieve the great. Beware of timidity, laziness and complacence. Focus on consistent hard work, good communications, positive energy and pacing.','Rising to a higher level. Setting a higher goal and working toward it step by step.','Field','Penetrating'),(47,'Confining / Oppression','Find ways back to common values. Confront your fate and release its purpose. Don’t just put a new face on things. Beware of giving up. Do not cooperate with existing powers. Do as little as possible.','Restriction and distress. Turning inward through accepting enclosure.','Lake','Ghost River'),(48,'The Well','Interact with others. Work for the common good. Mutualize purposes. You don’t need to bite through obstacles. Beware of small-mindedness and failing to answer a real human need. Be inventive. Help people help each other. Contribute to providing means to put these ideas into the world.','The life water coming from the depths that everyone may draw on. Maintaining access to this central source.','Ghost River','Penetrating'),(49,'Skinning / Revolution','Get rid of obsolete ideas. Regulate your calendar to reflect the changes. Do not keep things hidden. Beware of going to extremes, violent or partisan attitudes. Adapt existing resources to new ends by addressing fundamental needs.','Stripping away a protective cover. Radically changing and renewing the way you present yourself.','Lake','Radiance'),(50,'The Vessel','See your problems symbolically. Correct your situation to stabilize your destiny. Don’t confront problems directly. Beware of neglecting wider cultural and social needs. Pay attention to art, education and inner work.','The imaginative capacity of a sacred vessel. Securing and imaginatively transforming the material at hand.','Radiance','Penetrating'),(51,'Shake / Groundbreaker','Stir things up and eliminate old patterns. Transform fear and anxiety by carefully inspecting and adjusting your attitudes. Don’t be timid. Find the source of all misfortune by examining your own motives and attitudes. Change yourself and you change the situation. Do not oppose the order of creative change. ','A disturbing and inspiring shock. Rousing things to new activity.','Thunder','Thunder'),(52,'Bound / Gatekeeper','Ponder things carefully and do not come out of your hidden place. Articulate the lessons of the past. Control quality. Get things done. Beware of tension, ignorance, dishonesty and distrust. Seek a natural balance of rest and movement.','Confronting a boundary or obstacle. Stopping and acknowledging the limit.','Mountain','Mountain'),(53,'Gradual Advance','Reside in your inner power and use it to help others. Do not expect radical changes. Beware of greed and egotistical ambitions. Concentrate on steady long-term goals with a focus on real values.','Gradually achieving a goal. Advancing through diffuse but steady penetration.','Penetrating','Mountain'),(54,'Marrying Maiden','Hold onto what is enduring and complete and use it to determine what is flawed. Don’t think of this as a gradual buildup. Beware of imposing ideas and misconstruing the situation. Express yourself and connect through real feeling. ','The changing status of someone who cannot control their circumstances. Finding a real field of activity through accepting this imposition.','Thunder','Lake'),(55,'Abounding','Spread the wealth to all. Keep your focus. Use severe measures to correct wrongdoing. Beware of melancholy, doubt and negativity. Be positive even when you do not feel like it. Take chances on the new and offbeat.','Profusion and abundance reaching culmination. Exuberantly increasing things to their fullest.','Thunder','Radiance'),(56,'Sojourning','Spread the word. Be aware and considerate without relaxing the rules. Don’t try to change the world. Beware of pride, presumption, arrogance, disrespect and condescension. Recognize you are a guest in someone’s home and act accordingly. ','Wandering journeys and living in exile. Mingling with others as a stranger whose identity comes from a distant center.','Radiance','Mountain'),(57,'Subtle Penetration / Matchmaker','Spread the mandate to move the people to service. Do not just stir things up. Do not lose sight of where you are going. Be clear, expose the difficulties and unravel the mysteries. ','Providing an underlying support. Subtly penetrating and nourishing things from below.','Penetrating','Penetrating'),(58,'Opening / Mediator','Spread the word through inspiring words and images. Promote, explain, repeat and do not pull back. An unfeeling atmosphere will undermine vitality. Communicate positive feeling, togetherness, enthusiasm, joy and laughter. ','Interaction and exchange. Stimulating things through cheering and persuasive speech.','Lake','Lake'),(59,'Dispersing','Dissolve old structures and liquidate assets. Establish new principles and let go of the old ones. Beware of a false attitude of superiority not grounded in value. Don’t try to protect your weakness. Organize your own spiritual orientation. You will see the source of difficulties and how they can be overcome. ','Confronting obstacles, illusions and misunderstandings. Clearing away what is blocking the light.','Penetrating','Ghost River'),(60,'Articulating','Set measures and limits. Distinguish things and then join them together. Deliberate and measure. Use your inner power to move people. Do not over or under commit. Know yourself well. Marshal all the facts and use your creative judgment.','Confused relations. Making limits and connections clear, particularly through speech.','Ghost River','Lake'),(61,'Opened Heart / Connect to Center','Connect your inner and outer goals. Release people from fear. Impose real directions. Beware of hasty judgment, one-sided policies and personal greed. Trust in honesty and clear communication. Focus on true ideals and the common good. ','The relation between your inner core and the circumstances of your life. Bringing your central concerns and your life situation into a sincere and reliable accord.','Penetrating','Lake'),(62,'Small Traverses / Flying Bird','Finalize all the details. Stay in the process and adapt. Be very careful, frugal and courteous. No big plans. Beware of doing anything out of the ordinary. Don’t act on sudden inspirations. Keep your feet on the ground. Do not think about the future. ','An overwhelming variety of encounters and details. An excessive concern with adapting yourself to these inner and outer events.','Thunder','Mountain'),(63,'Already Crossing','Proceed actively. Stay the course. Think about danger and prepare a defence. Beware of blind confidence and over-achieving. Maintain balance and pace. Use your intuition.','An important move from one position to another. Actively proceeding with the crossing.','Ghost River','Radiance'),(64,'Not Yet Crossing','Gather energy for a major change. Consider the situation carefully. Clearly differentiate roles, goals and resources. Beware of lack of confidence or a critical attitude. Keep your eyes open. Distinguish the signs of the time and move with them. Adapt to the flow.','Being on the edge of an important change of situation. Waiting and accumulating energy to begin the upcoming move.','Radiance','Ghost River');
