INSERT INTO `hexagram_line` VALUES (1,1,1,1,'Immersed Dragon, do not use it!','The situation feels confused. You would like to take hold and set it right. Give up your impulsive desire to act and let things circulate. Act slowly and carefully to build the base. Do not try to push this away. Things are taking form now. Have no fear. This return of the spirit attracts a new fate. You are coupled with a creative force.',44),(2,1,2,1,'See the Dragon in the fields! Advantageous to see the Great People. Harvesting.','You have the ability to realize things now. Take the advice of those you trust. Locate yourself in the center of this force and you will find a real purpose. Let any distress you might feel return you to the Way. No need to repeat or rehearse things now. Your inner drive is straight, square and great. There is nothing that will not benefit. Have no fear. This inner re-organization brings harmony with others. You are coupled with a creative force.',13),(3,1,3,1,'Noble One completes the day using Inspiring Force again and again. At night come alarms and adversity. This is not a mistake.','This is a transitional time of incessant activity. Do not try to be the great leader now. Continue toiling humbly to bring things to completion. This is the place of hidden excellence. If you do try to accomplish something quickly, you can bring all your plans to a beautiful completion. This inner re-balancing lets you make your way in life. Step out to meet the new destiny. You will find supportive friends. Gather energy for a decisive new move.',10),(4,1,4,1,'Someone is playing in the depths. This is not a mistake.','Real creative energy emerges now. Do not lose the playful spirit. Let bad blood and apprehension depart. Have no fear. You will gather friends as a hair clasp gathers the hair. Everything you want is bundled in the bag. This inner preparation leads to what is greater. Step outside the norms and re-imagine the situation. Co-operate with the ongoing process of change.',9),(5,1,5,1,'Flying Dragon in the Heavens. Advantageous to see the Great People! Harvesting.','Let your creative power emerge. You can build something enduring now. Your energy and awareness will impress others. There are hidden connections that open the flow, a source of great good fortune. Be generous.  Even though things may look confusing there are hidden processes at work that open the way to enduring connections. This inner re-grouping lets your real purpose shine. Be resolute and part from the past. You are connected with creative force.',14),(6,1,6,1,'Overbearing Dragon, heading into the gully. There is cause for sorrow.','If you keep pushing on now you will misuse the creative energy. It is time to withdraw. There is a ripe fruit uneaten and you must carry it away. Have no doubts. It is time to be resolute and part from the past. Do not just change your face. Follow this and have no doubts. This inner stripping away leads to a breakthrough. You are connected to a creative force.',43),(7,2,1,0,'Treading the frost culminates in hardening the ice. The marriage time draws near.','The new time is coming. The situation feels confused and uncertain but do not try to dominate things or act on impulse. Yield, give way and restore the peace. This is a time to part from the past. Do not try to push this way. Do not just change your face. Take in the lessons of the past. Be open and provide what is needed.',24),(8,2,2,0,'Straight, four sided and Great. No need to repeat or rehearse. Nothing not advantageous.','The situation is pregnant with possibility. Everything you want is already there. Have no fear. This will gather friends around you. Creative energy emerges into the lower field of action, giving you the ability to realize your plans. Locate yourself in the center of this energy and you will find a real purpose. Build your reserves for the future. Joy and play are the keys now. Let any distress you feel return you to the Way. Gather energy for the decisive new move.',7),(9,2,3,0,'Trial: a jade talisman, held in the spirit’s mouth, a containing beauty that empowers. If someone follows the King’s service, the time of no accomplishment comes to an end.','This is the place of hidden excellence. If you do not act prematurely you can accomplish all you desire. Continue toiling humbly to bring things to completion. Do not try to act like a great leader. Turn your back on the past. These comings and goings release the energy now bound up in the past. Co-operate with the ongoing process of change.',15),(10,2,4,0,'Bundled in the bag. Without fault, without praise.','The situation is pregnant with possibility. Everything you want is already there. Have no fear, this will bring great success and gather friends around you. Build your reserves for the future. Joy and play are the keys now. Let the bad blood depart. Step outside the norms and re-imagine the situation. Gather energy for the decisive new move.',16),(11,2,5,0,'Yellow lower garments. Wise Words: The Way to the Source is open.','There are hidden processes at work now that will lead to great and enduring connections. Accept them though things may look confusing. The connection to the spirit you have now will impress others. Let your power emerge. Be generous.  Now is the time to build something enduring. Be open and provide what is needed.',8),(12,2,6,0,'Dragons grapple in the countryside. Their blood flows down, dark mystery into the yellow earth.','The new time is coming. If you try to dominate the situation it would be a misuse of creative energy. Yield, give way and restore the peace. Do not just change your face. Take in the lessons of the past. There is a ripe fruit uneaten and you must carry it away. Be open and provide what is needed.',23),(13,3,1,1,'A stone pillar. The riders wheel and turn. Trial: Advantageous for a residence. Advantageous to install lords as helpers.','Stop and establish your deep foundations. Empower others to help you. You have a mandate to lay out a new city and receive the dwellers. Do not be violent or withholding. You would be attacking the protection that will bring things to maturity.',8),(14,3,2,0,'Sprouting then quitting, bunching and turning, riding the horses in full array. Those who arrive are definitely not outlaws. Seek the marriage alliance. Trial: The woman will not yet nurse a child. Ten years, then she will nurse one.','You reach out to people then turn away. Drop the hostility. Leave your usual ways of thought. Dissolve the past in the sweat of this new endeavour. It will take time, but in the end all will come right. There is something of great worth in this situation.  Be open and provide what is needed.',60),(15,3,3,0,'Chasing the deer without a guide, you wander alone into the forest center. The Realizing Person almost fails to realize that going on will bring distress.','You are being carried away by your impulses. Do not go on like this. Do not confine your spirit in outmoded desires. It is time to eliminate the negativity and compulsion. Protect the real transformation that is going on. Co-operate with the ongoing process of change.',63),(16,3,4,0,'Bunching and turning, riding the horses in full array. Seek the marriage alliance. Wise Words! Going on opens the Way. Nothing not advantageous. Harvesting.','Go forward. Make the connection. Everything will benefit. Do not chase things. Connect with the flow and your understanding will be brightened. Do not be grasping or try to exploit this opportunity. Correct the corruption of authority. Proceed step by step.  Gather energy for a decisive new move. ',17),(17,3,5,1,'Sprouting: its juice. Reward of food for the soldiers. Trial for the Small: Wise Words! The Way is open. Trial for the Great: Trap! The Way is closed.','You have found the essence of growth. Make sure everything gets what it needs. Adapt to what happens, do not try to impose your will. Be generous now and you can renew the entire situation. Mark things off clearly and strip away old ideas. Let in the new connections and take control of your dwelling.',24),(18,3,6,0,'Riding the horses in full array, while weeping blood courses down.','Free yourself from this entangling situation. Diminish your attachment. Strip away your old ideas. Punish those who deserve punishment, and free your youthful spirit. Take this in or the situation could do real harm. Be open and provide what is needed.',42),(19,4,1,0,'Enveloping shooting forth. Advantageous to punish people. Harvesting. Loose the fettered, shackled youth or going on brings distress.','You must correct a far-reaching error Do not just sit there weeping. Take this in, punish those who need to be punished and set your spirit free. Let go of past pain and sorrow. Diminish your compulsive involvements and leave quickly. Something important is returning. Be open and provide what is needed.',41),(20,4,2,1,'Enwrapped and Enveloped. Wise Words! The Way opens. Let in the wife. This young son can control the dwelling.','It is time to take a wife and found a dwelling. You have the ability. You have found the vital source of growth. Make sure everything gets what it needs. You must renew the source of support and intimacy. Mark things off clearly. Strip away old habits and ideas. Act generously now, for this return is a triumph.',23),(21,4,3,0,'Do not try to grasp this woman! See her armored husband. Do not try to possess her body! There is no advantageous direction.','You are flirting with something beyond you. Let this temptation go and you can realize your real potential. Locate yourself in the flow, let go of ambition and you will be enlightened. You must correct the corruption of authority and the use of power. Have a great purpose. You will soon meet people with whom you can find a real alliance that will be of great benefit. If you let yourself be led now, you can realize the hidden potential. Co-operate with the ongoing process of change.',18),(22,4,4,0,'Enveloping Confined. Distress.','You are cutting yourself off from what is real, following old and delusive desires. You are at the edge of disaster. Stop now. Eliminate the old negativity and release the creative shock of the new. Protect the transformation that is already underway. Gather energy for a decisive new move.',64),(23,4,5,0,'The foolish youth Enveloped. Wise Words! The Way opens.','Accept your immaturity and that something is hidden in this situation. All will go well. Do not reach out to people then turn away. Dissolve the past in the sweat of a great new endeavor. It will take a while but in the end all will come right.',59),(24,4,6,1,'Attacking what Envelops you. Not advantageous to act like an outlaw. Advantageous to resist being an outlaw. Harvesting.','You are fighting the very things that will bring you what you need. Do not be violent or withholding. Connect this experience to your deep roots. Lay out the city and receive the dwellers. Do not simply adapt. Something important is returning.',7),(25,5,1,1,'Attending at the outskirts. Advantageous to fix the omen! This is not a mistake.','Though there is heavy going at the beginning, endure in your efforts. You confront a long neglected source of common feeling. Do not let your own doubts oppress you. Do not follow the corrupt old ways. Co-operate with the ongoing process of change.',48),(26,5,2,1,'Attending on the sands as the waters recede. There is the Small, talking. Complete this. Wise Words! The Way opens.','You are closer to your goal but the situation keeps shifting. Keep your eye on what is important. What you have lost will return of itself. You will have the chance to plead your case before a real authority. Your purpose will emerge and gather others around you. This will open a better time. Co-operate with the ongoing process of change.',63),(27,5,3,1,'Attending in the bogs and swamps. Danger! This will attract outlaws in the end.','You are bogged down in negative feelings. This leaves you open to danger. If you do not articulate real needs and desires now you will soon have cause to lament. Retreat and ponder what is really important. Withdraw from the conflict and return to the source.  A hidden mission awaits you. Take in the past. Be open and provide what is needed.',60),(28,5,4,0,'Attending in blood. Get out of the cave where this begins!','You are in immediate danger. Get out of this place. You are surrounded by people intent only on greed and power. Hold on to what is great and go on alone. Take in the ancient wisdom. The rain will soon come to clean out the old wound. Be resolute. You are connected to a creative force.',43),(29,5,5,1,'Attending, drinking liquor and eating at the sacred meal. Trial: Wise Words! The Way opens.','Retreat from conflict and return to where you feel secure. Come out of isolation. Share what you have and gather with others in the spirit of harmony and joy. This is an omen of future happiness and a joyous new time. If you let yourself be led you can realize the hidden potential. Co-operate with the ongoing process of change.',11),(30,5,6,0,'Enter the cave. The visitors come without urging. There are three coming towards you now. Respect them and complete this. Wise Words! The Way opens.','Changes are coming that will bring you help in an unexpected way. Respect them.  Do not set off on an expedition now and do not try to discipline others. Follow your true desire. Act through the receptive and end your involvement with the sorrows of the past. Co-operate with the ongoing process of change.',9),(31,6,1,0,'This is not a place to prolong your service. Use Small words to bring it to completion. Wise Words! The Way opens.','This is not a place for you to be of service. Bow out gracefully. Changes are coming so abide in your power and virtue. Do not try to discipline others. Simply follow your real desire and welcome the signs of the new. Step outside the norms. You will soon find supportive friends. Gather energy for a decisive new move.',10),(32,6,2,1,'You cannot master this Dispute through pleading. Flee to your capital, your people’s three hundred doors. This is not an error.','You cannot win this fight so flee quickly. Go to where you feel secure. When the distress ends, friends will seek you out. You are facing oppression and blocked communication but a new time is approaching. Join those with whom you feel a true connection. Let yourself be led and you can realize the hidden potential. Co-operate with the ongoing process of change.',12),(33,6,3,0,'Eat the ancient power and virtue. Trial: Wise Words! The Way is open. Complete the adversity. Face the hungry souls and angry ghosts. If someone follows a King’s service, it will not be accomplished now.','To deal with this you need the insight of ancient wisdom. Do the inner work and go through the adversity. You are surrounded by cruel people intent only on mastery and power. Part from the past and go on alone, even if you move haltingly. Keep a sense of the great within. You are connected to a creative force.',44),(34,6,4,1,'Do not try control this Dispute through pleading. There will be changes. Return to the source, your Mandate is approaching. Trial: Wise Words! You are safe and secure. The Way is open.','Retreat from this conflict for a great change is coming. Things will deteriorate at first, but you are safe. You must articulate real needs, goals and desires now or you will soon have cause to lament. Retreat and ponder what is of true worth. Do not simply wait in the swamps of despair. Take in the lessons of the past. The new will come shining through. Be open and provide what is needed.',59),(35,6,5,1,'Dispute. Wise Words! Plead your case. The Way to the Source is open.','State your case with clarity and confidence and expect positive results. What you have lost will return by itself and let the light of your real purpose shine through. Complete this task and move to the center. Your sorrows will disappear and new connections arise. Gather energy for a decisive new move.',64),(36,6,6,1,'Dispute. Someone bestows a leather belt on you. Complete dawn three times and you will be deprived of it.','Contesting for mastery in a corrupt situation brings you no real honor. Anything you gain will vanish. You are trapped in your own doubts and fears now. Do not follow these old ways. It may feel like the spirit is far away but the new connection is certain. Create a clear image of your real goal. Step outside the norms. You will soon find supportive friends. Gather energy for a decisive new move.',47),(37,7,1,0,'Legions issue forth using trumpets and orders. Obstructing their power? Trap! The Way closes.','Be sure the rules you set do not obstruct your real power. Release your spirit into a new image. Measure things against the ideal of the Realizing Person who seeks to live in accord with the flow. Without this the group you lead will be without a true goal. Something important is returning now. Be open and provide what is needed.',19),(38,7,2,1,'Located in the center of the Legions. Wise Words! The Way is open. This is not a mistake. The King bestows a mandate three times.','You are in the center of a well-organized force and receive a command to act. Carrying this through will change your life. No need to repeat or rehearse things. Act freely. These hidden processes will lead to enduring results. If you are magnanimous in your victory, the true connections will manifest themselves.',2),(39,7,3,0,'The Legions are carting the corpse. Perhaps stay in mourning? Trap! The Way closes.','Get rid of false images and useless ideas. There is no resistance in sight. You are outside the normal group now precisely because of your real moral and spiritual worth. Hold onto your values and you can truly influence others. The great project opens from this gathering. If you let yourself be led you can realize the hidden potential. Co-operate with the ongoing process of change.',46),(40,7,4,0,'Legions retreat and rest on the left. This is not a mistake.','This is a time of rest and re-organization. Splitting from your current partners brings new energy that will carry you through. Do not ally yourself with the old oppressors. Have no fear. Difficulties are going and the reverse is coming. This will release energy bound in the past. Co-operate with the ongoing process of change.',40),(41,7,5,0,'The birds of prey take to the fields. This is not a mistake. Advantageous to seize them and put them to the question. Let Elder Son conducts the Legions while Younger Son carries the banner. Perhaps stay in mourning? Trap! The Way closes.','Conflict has broken out and you must engage. Be aggressive. Rid yourself of old ideas and bad memories. Do not be trapped in the pit of the past. Be flexible and adapt and carry your inspiration with you. You are at the center of the new group. Take decisive action. Be open and provide what is needed.',29),(42,7,6,0,'The Great Leader receives a Mandate: Lay out the city and receive the Dwellers. Do not use Small People.','The campaign is over. You have the responsibility to lay out the new capital. Do not simply adapt to the past. Take time and establish real foundations. Connect this experience to your own deep roots. Empower others you truly respect to help you. Do not be violent and impulsive for you would be attacking the very process that will give you what you need. Something important is returning. Be open and provide what is needed.',4),(43,8,1,0,'Group them! A connection to the spirits will carry you through. This is not a mistake. This connection fills the earthen vessels to overflowing. The completion is coming. Even more! Wise Words! The Way opens.','This connection is certain and filled with spirit. Do not attack the processes that will give you what you need. Connect this with your own deep roots. Empower others you truly respect to help you. You have received a command to create a new organization. Use all your powers to make this a beautiful place. Strip away your old ideas. Be open and provide what is needed.',3),(44,8,2,0,'Group them from the origin inside. Trial: Wise Words! The Way opens.','You are at the center of this group. Gather the people and do not let the connection slip through your fingers. Get rid of old ideas and bad memories. There is no need to add more. Conflict has broken out and you must engage whether you like it or not. This is an important transition. Adapt to the new situation that confronts you.  Be open and provide what is needed.',29),(45,8,3,0,'Grouped with the victims! Trap! The Way closes.','You are involved with the wrong people. The armies must retreat now but have no fear.  Splitting from your current partners will re-connect you to the spirit. Difficulties are going and the reverse is coming. Step outside the norms and re-imagine the situation. Gather energy for a decisive new move.',39),(46,8,4,0,'Outside the Group. Trial: Wise Words! The Way is open.','You are outside this group because of your real moral and intellectual worth. Stick to your values and you can influence things. Old memories and useless ideas will defeat you now if you let them. The way to something great opens from here. Proceed slowly and surely. Gather energy for a decisive new move.',45),(47,8,5,1,'Illustrious Grouping! The King uses beaters on three sides of the hunt. He lets the game go that runs before him, The capitol’s people are not frightened away. Wise Words! The Way is open.','You are at the center of a well-organized force and have received a command to carry out your plans. Going through with this will change your life. There is no need to rehearse or repeat things now. Do not try to coerce people. Let your virtue and compassion shine. Act freely and generously and these hidden processes will lead to enduring new connections. Be open and provide what is needed.',2),(48,8,6,0,'Grouping them without a head. Trap! The Way closes.','This group has no goal and no purpose. Be sure the rules you have set are not obstructing your real power. A connection to the spirit is nearing. Let go of the old and measure things against the ideal of the Realizing Person who seeks to live in the flow. Strip away your old ideas and release the bound energy.  Be open and provide what is needed.',20),(49,9,1,1,'Returning to the birth of the Way. How could this be a mistake? Wise Words! The Way opens.','You have been lost in a cloud of confusion but now you can see. Do not be timid. Advance and retreat like a warrior. Extend the opening and the possibilities for new connections. If you look at your steps you will see that you are connected with something larger than your personal desires. Step outside the norms. Co-operate with the ongoing process of change.',57),(50,9,2,1,'Returning like an animal led on a leash. Wise Words! The Way opens.','You have been lost and confused but are hauled back to what is important. Have no concern for glory or achievement. Locate yourself in the center and nourish your people. All cause for sorrow and discord will soon disappear. Tread on and part with the past.  Gather energy for a decisive new move.',37),(51,9,3,1,'The spokes of the cartwheel loosen. Husband and wife turn their eyes to one another.','You can resolve old quarrels now, the endless cycle of charge and countercharge. Preserve your integrity by connecting to what is above and let your old identity disappear. If you carefully present your case, you can acquire a new destiny. Be open and provide what is needed.',61),(52,9,4,0,'There is a connection to the spirits that will carry you through. Bad blood leaves and apprehension departs. This is not a mistake.','Act with confidence. Leave the old quarrels behind. Creative energy is available now. Use it. This marks a return of the flow in your life. Trying to be a great leader leaves you open to danger. Step outside the norms and re-imagine the situation.  Simply co-operate with the ongoing process of change.',1),(53,9,5,1,'There is a connection to the spirits that binds you to others. Use your neighbor’s affluence.','You have a real connection to those around you. Do not be afraid to use it for the good of all. You can eliminate a powerful enemy. Disentangle yourself from the past. Smooth the way by acting from hiding. Success will spontaneously arrive. Step outside the norms and re-imagine the situation. Co-operate with the ongoing process of change.',26),(54,9,6,1,'We will plant the crop. The rain has already come. You already abide in honor, power and virtue. Carry on! The Moon is almost Full: There will be changes. Trial: Adversity from the wife’s people, hungry souls and angry ghosts. If the Realizing Person seeks to chastise others, Trap! The Way will close.','You have achieved your goal and the rain falls to bless you. Do not try to discipline others now. Do the inner work and the new energy will come without urging. Respect it. Move with your real desires. Leave the old disputes behind. Step outside the norms and re-imagine the situation. Co-operate with the ongoing process of this change.',5),(55,10,1,1,'Treading. Going simply in white silk shoes. This is not a mistake.','Act on your real desires. Be simple and pure. Changes are coming and if you move with them the happiness you know can endure. Do not try to discipline others now. Leave old disputes behind. Enter the hidden center and the new energy will come without urging.  Gather energy for a decisive new move.',6),(56,10,2,1,'Treading the Way, smoothing it, smoothing it. Trial: Wise Words! The Way is open to the Mountain People.','There is a hidden connection open now that binds you to the people you truly belong with. Accumulate this new spirit and you can eliminate a powerful enemy. Disentangle yourself from the past. Success will arrive spontaneously. Step outside the norms. Gather energy for a decisive new move.',25),(57,10,3,0,'This one squints and thus can see. This one limps and thus can Tread. This one Treads on the Tiger’s tail and it bites him. Trap! The Way closes. This is a soldier trying to act like a great leader.','Do not presume on inadequate powers. Do not be trapped in compulsive actions. Forget the old quarrels and your desire to control others. Stay alert. Do not let them trap you into compulsive action. Unite your purpose with what is above. You are connected to a creative force.',1),(58,10,4,1,'Treading on the Tiger’s tail. Carefully, carefully present your petition. Bring this to completion. Wise Words! The Way opens.','Present your case to the highest power now and you acquire a new destiny. Preserve your integrity by connecting to the above. You can end the endless circle of charge and countercharge and open the way for new life to enter. Take in the lessons of the past. Be open and provide what is needed.',61),(59,10,5,1,'Treading and parting. Be decisive. Trial: Adversity, the hungry souls and angry ghosts.','You must decisively separate yourself from a dangerous influence. Have no fear. Face the danger. Have no concern for glory or achievements. Locate yourself in the center and nourish your people. All cause for discord and sorrow will disappear. Step outside the norms and re-imagine the situation. Co-operate with the ongoing process of change.',38),(60,10,6,1,'Look at your steps. Watch the omens. The predecessors are blessing you. Wise Words! Their eternal return opens the Way.','If you look at what you have done you see that it connects with something larger than the personal. This is not the time to be timid. Express yourself freely. Extend the gift you have been given. Change direction as often as necessary. You can end the entangling circle of charge and countercharge. Have no fear. You will soon find supportive friends. Gather energy for a decisive new move.',58),(61,11,1,1,'Pull up and weave the twisted thatch-grass, each with its kind. Wise Words! Chastising opens the Way.','Take vigorous action to get out of this lowly place. Find who you belong with. Expressing your feelings topples obstructions and subverts corrupt authority.  Step outside the norms. Co-operate with the ongoing process of change.',46),(62,11,2,1,'Put on the hollow gourds and cross the River. Do not put off leaving. Your partners disappear. You acquire honor by moving to the center.','You are unrecognized but you can rescue the situation with a burst of invigorating strength. Losing or acquiring, have no cares. Attach yourself to the quiet at the center of the heart and you will soon flourish. These goings and comings release energy bound up in the past. Co-operate with the ongoing process of change.',36),(63,11,3,1,'No level that does not slope. No going without a return. Trial: this hardship and drudgery is not a mistake. Have no cares. You are connected to the spirits. You will share the great meal and find Heaven’s blessing.','If you do not let go of what you have, the spirit cannot return. Go through the hardship. You will experience a real renewal. Your present connections may look sweet, but no good can come of them. Your grief at their failure will release you. You have received a gift from above and it is your job to cultivate it. Something significant is returning. Be open and provide what is needed.',19),(64,11,4,0,'Fluttering, fluttering, like a young bird leaving the nest. Have no fear. This is not a warning. If you are not affluent, use your neighbor’s wealth. Your connection to the spirits will carry you through.','If you need help, ask for it. Come out and live in the great world. Act on your heart’s desire. This is a time for resolute action. Break through the entanglements and the cause for sorrow will disappear. You are connected to a creative force.',34),(65,11,5,0,'The great ancestor offers the maidens in marriage. Use this happiness and satisfaction. It is the footstep of the spirit. Wise Words! The Way to the Source is open.','This is an omen of great future happiness. You make the new connection with a single try. Gather with others and share what you have.  Make a hidden offering and stay true to yourself. The old quarrels will disappear and new friends will seek you out. Step outside the norms and re-imagine the situation. Co-operate with the ongoing process of change.',5),(66,11,6,0,'The city walls dissolve and return to the moat. Do not use the legions. This originates from the capital. Trial: Distress.','The structure of things collapses but this disaster may turn out to be heaven’s highway. Disentangle yourself from your own negativity.  Take vigorous action to find the people you really belong with. An unexpected encounter will soon change the whole situation. Step outside the norms and re-imagine the situation. Co-operate with the ongoing process of change.',26),(67,12,1,0,'Pull up and weave the twisted thatch grass, each with its kind. Trial: Wise Words! The Way opens. Make an offering and you will succeed.','Retreat and join with others of like kind. The structure of things has collapsed. Do not act aggressively for this dissolution has fate behind it. You are in the right position to open the new time.  Disentangle yourself from old compulsions and accumulate the new spirit. An unexpected encounter will soon change the situation. Step out to meet the new destiny. Gather energy for a decisive new move.',25),(68,12,2,0,'Lay out the offerings. Wise Words! For Small People the Way is open. Great People are Obstructed. Make an offering and you will succeed.','Make a hidden offering and accept that your great idea is obstructed. There is an omen of future happiness here that will gratify all your desires. Flee disputes and go to where you feel welcome. When the quarrels of the past disappear, new friends will seek you out. Step outside the norms. Gather energy for a decisive new move.',6),(69,12,3,0,'Obstruction. Do not be the victim. Lay out the offerings.','Stop and examine yourself and your motives. Do the inner work. This is a time to retreat from past conflicts and use your connection to those who are your spiritual kin. If you act on your heart’s desire you can break through this entanglement. You are coupled with a creative force.',33),(70,12,4,1,'In Obstruction there is a mandate: An oriole in a plowed field. Cultivate this in radiant satisfaction. This is not a mistake.','In the middle of a dark time you experience an inspiring insight. Cultivate it through withdrawal. Your present connections may look sweet, but no good can come of them. Let your grief at their failure release you. You face a difficult time but if you do not let go of your present situation the spirit cannot return. In the end you will spread light to all. Be open and provide what is needed.',20),(71,12,5,1,'Relinquishing the Obstruction. Wise Words! For the Great Person the Way opens. It disappears! It disappears! Attach it to the bushy Mulberry Tree.','Withdraw to a peaceful place where you can focus on what is truly important. Those you identify with will disappear. Though you may feel hurt, you can rescue this situation with a burst of invigorating strength. The cause for sorrow will soon disappear. These goings and comings release the energy now bound up in the past. Have no cares. Gather energy for the decisive new move.',35),(72,12,6,1,'Subverting the Obstruction. First bad! Then rejoicing.','The very thing causing you difficulties will soon become a cause to rejoice. The old time is ending. Take vigorous action to find who you really belong with. Let your tears flow and open your heart anew. This will release you from the past and make the new connections. Step out to meet the new spirit. Gather energy for a decisive new move.',45),(73,13,1,1,'Harmonizing people gather at the gates. This is not a mistake.','You are about to cross the threshold to join with others but are temporarily entangled. Have no fear. Going through this hardship connects you with the flow. Heaven shields the birth of this group. You are coupled with a creative force.',33),(74,13,2,0,'Harmonizing people in the ancestral hall. Distress.','You are distressed as you measure yourself and your goals against the great ideals. Let your distress return you to the flow. Creative energy is appearing now, connecting what is above and what is below. Have no fear. Mingle with others and your energy will impress and unite them. You are coupled with a creative force.',1),(75,13,3,1,'Harmonizing People hide arms in the thickets. Ascend your high grave mound. For three years you will not rise up.','Retreat and prepare a countermove. This may seem like a disaster but if you move with it you can eliminate the old negativity. This is not the time for aggression or insistence on your ideas. Accumulate the strength to carry heavy loads and confront difficult situations. Proceed step by step. Gather energy for a decisive new move.',25),(76,13,4,1,'Ride your city ramparts. Nothing can control or attack you. Wise Words! The Way opens.','Depend on the harmony of your people. Have no doubts. Trust your purpose. This will reverse an oppressive situation. Great affluence will flow from this group. If you leave it you will see your plans fail and be cast out. Concentrate all you have and offer it to the highest principle. Gather energy for the decisive new move.',37),(77,13,5,1,'Harmonizing People first cry and sob and then they laugh. Great Leaders meet to mutualize their power.','Mutualize your purposes with others. Everything will conspire to help you. Let your tears flow, for they release you from past sorrows. Bright new spirit is rising in this group. You need an inspiring idea to carry you. Make a plan and dedicate yourself. Do not be afraid to act alone. You are connected to a creative force.',30),(78,13,6,1,'Harmonizing People at the outskirts. Without a cause for sorrow.','This is the emergence of the great new purpose. Make the change with grace and elegance. Overturn things to clear communication. There is nothing harmful in your aims. The confused movement you experience now is a good omen for beginnings. Respect it. Strip away the old. You are coupled with a creative force.',49),(79,14,1,1,'Crosswise omens. Without harm. Mingle with this spirit. This is not a mistake. The hardship involved is also not a mistake.','This is a good omen for beginnings. There is nothing harmful in your desires. Accept the hard work. Make this radical change with grace and elegance. Overturn old ways of thought to clear the obstructions to communication. Be resolute and part from the past. You are connected to a creative force.',50),(80,14,2,1,'Use a great chariot to carry this. Have a direction to go. This is not a mistake.','Have a vehicle, an inspiring idea to carry your plans and desires. Great leaders are meeting now to mutualize their purpose for the good of all. You will soon have cause to rejoice. The bright new energy is rising all around you. Do not be afraid to act alone. You are coupled with a creative force.',30),(81,14,3,1,'A prince makes this sacrifice to the Son of Heaven. Small People cannot use or control it.','Concentrate all you have and offer it to the highest principles. Do not simply adapt. Depend on the harmony of your people. Nothing can attack or control you now. This will reverse what feels like an oppressive situation. Great affluence will flow from this group. Co-operate with the ongoing process of change.',38),(82,14,4,1,'Do not seek dominance!  This is not a mistake.','Do not try to dominate. Let your spirit shine through others now. Retreat and prepare a countermove. This may seem like a disaster, but if you move with it rather than staying in the same place you can eliminate an old problem. Let yourself be led and you can realize the hidden potential. Co-operate with the ongoing process of change.',26),(83,14,5,0,'You have a connection to the spirits that carries through to others. An awesome presence! Simply mingle and you will impress them. Wise Words! The Way is open.','Be versatile and do not prepare things. Act with complete confidence. Think of your real ideals and let any distress you may feel return you to your real purpose. Creative energy is emerging now, connecting the above and the below. Have no fear. Use it freely. You are connected to a creative force.',1),(84,14,6,1,'Heaven shields its birth. Wise Words! The Way is open. Nothing not advantageous. Harvesting.','Heaven protects your endeavor. This will benefit everything. Though your advance is temporarily entangled, have no fear. Going through the hardship opens the way to real blessing. Be resolute and part from the past. You are connected to a creative force.',34),(85,15,1,0,'Humbling bites through. The Realizing Person uses this to step into the Great Stream. Wise Words! The Way opens.','Work hard at this. Keep your pride out of the way. This is the difficult journey that brings deliverance. Work on in the dark to prepare the future. Master your words and you can influence people. These goings and comings release energy bound up in the past. Co-operate with the ongoing process of change.',36),(86,15,2,0,'Humbling signals to others. Trial: Wise Words! The Way opens.','The inner work you are doing calls out to others. This can be an ever-flowing source of energy and inspiration. Gather people in ranks and give them positions. Provide for what has been hurt. Give this an enduring place in your heart. If you let yourself be led now you can realize the hidden potential. Co-operate with the ongoing process of change.',46),(87,15,3,1,'The Realizing Person, toiling, toiling through Humbling, brings what he desires to completion. Wise Words! The Way opens.','Humbly work at this. You do not need to advertise. Unconscious powers are working for you. This is a containing beauty that empowers you. Everything is bundled in the bag. Do not doubt. You will soon gather friends like a hair clasp gathers the hair and acquire whatever you need.',2),(88,15,4,0,'Demonstrate Humbling. Seize the moment. There is nothing for which this will not be advantageous.','Seize the moment. Cut through pride and complications. Do not be attached to your ideas. Let the adversity that is going now be a warning. Do not carry on in the old ways. Do not be skeptical. Do not hold back. You are connected to a creative force.',62),(89,15,5,0,'If you are not affluent, use your neighbor’s wealth. Advantageous to attack and subjugate them. There is nothing for which this will not be advantageous.','You have a real purpose. Be aggressive and take what you need. Everything will benefit. In the greatest difficulties, partners will come. You can catch the hidden negative influences and acquire the power to act directly. The limits you have set yourself are turning you to stone so do not even complete the day like this. Step outside the norms. These goings and comings will release the energy now bound up in the past. Gather energy for the decisive new move.',39),(90,15,6,0,'Humbling signals to others. Advantageous to move the legions and chastise the capital city.','Focus your energy, marshal your forces and attack. You can set things right now. Be generous. Act with a clear heart. Let your actions call others, not your words. Be generous at this boundary and you will release the revitalizing energy. Co-operate with the ongoing process of change.',52),(91,16,1,0,'Calling out for a response. Trap! The Way closes.','Do not call out to others for help. Let your actions speak, not your words. Marshal your forces and attack. You can set right your place, eliminate negativity and be of real help to all. Be generous. This fertile shock will rouse new energy and soon all will laugh together. These goings and comings release energy now bound up in the past. Gather energy for the decisive new move.',51),(92,16,2,0,'The limits you set turn to you to stone. Do not even complete the day like this. Trial: Wise Words! The Way opens.','Free yourself from these constraints. Your purpose is correct and it is time to expand. Attack your problems aggressively. In the greatest difficulties partners will come. You can catch the hidden negativity and acquire the power to act directly. These goings and comings release the energy now bound up in the past. Co-operate with the ongoing process of change.',40),(93,16,3,0,'Skeptical response brings cause for sorrow. Holding back brings cause for sorrow.','Do not hold back. Provide what is needed. Cut through pride and complications. Do not get involved in old arguments and everything will fall into your hands. Let the adversity that is going now be a warning. Do not carry on in the old ways! Do not be afraid to act alone. You are connected to a creative force.',62),(94,16,4,1,'Do not doubt! This source Provides For a joyous response and Great acquisitions. You join friends in a string of cowries, as a hair clasp gathers the hair.','This is an undertaking sent from above. Have no doubts. You do not need to advertise for unconscious powers are at work on your behalf. Whatever you desire will simply appear. This is a containing beauty that empowers. All is bundled in the bag.',2),(95,16,5,0,'Provide for this. Trial: affliction. Fix the omen and you will not die.','This is a hard time. If you can see into the cause, the wisdom you gather will provide for you. The inner work you are doing now will call out to others. Open your heart. The new energy will carry you through. Gather the people in ranks and step out to meet the new destiny. All will be well in the end. Gather energy for the decisive new move.',45),(96,16,6,0,'The shadow world. Provide For new accomplishments. There will be changes. This is not a mistake.','Work on in the dark to provide for the future. Keep your pride out of the way. Your inner work will call out to others. Master your words and you can influence people. Attack the old ways and you will soon emerge into the light. These goings and comings release energy bound up in the past. Step outside the norms. Gather energy for the decisive new move.',35),(97,17,1,1,'If you have an office, deny it. There will be changes. Trial: Wise Words! The Way is open. Issue from the gate and mingle with others. There will be achievements.','Leave your old position and mingle with those beneath you. The connection is not complete but if you reach out you will all laugh together. Do not involve yourself in institutional corruption. Honor what is highest. Do not pause in your efforts to find the purpose of these changes. These goings and comings will release the energy now bound up in the past. Step outside the norms and re-imagine the situation. Gather energy for the decisive new move.',45),(98,17,2,0,'Tied to the small son, you let the experienced man go.','Let go of your self-importance, dissolve your connection to the corruption around you and open yourself to the new. Your work will be rewarded and the cause for sorrow will disappear. Do not get involved in disputes. Use praise to disarm your opponents. Gather energy for the decisive new move.',58),(99,17,3,0,'Tied to the experienced man, you let the small son go. Through Following you seek and acquire what you desire. Trial: Advantageous for a residence. Harvesting.','You are following the right influence. You will acquire what you desire. Establish your foundation. Let the images of change circle within you until the real call comes. If you co-operate with the corrupt authorities now you will be swept away when the real change comes. You are coupled with a creative force.',49),(100,17,4,1,'Following to hunt and catch. Trial: Trap! The Way closes. Connect to the spirits and locate yourself in the Way. Use what you are given and your understanding will be brightened. How could this be a mistake?','Do not turn following into hunting for game. You can change things easily now if you let go of aggressive desires. Do not grasp at things. Those you confront are not outlaws. Seek an alliance. Have a great purpose and confront the abuse of authority. Strip away your old ideas. Be open and provide what is needed.',3),(101,17,5,1,'A triumph. A connection to the spirits that leads to excellence. Wise Words! The Way is open.','You are called to serve now, so do not lose your sense of purpose. Still yourself and do the inner work. Do not run after impossible desires. You must confront the abuse of nourishment and care now. Gather energy for the decisive new move.',51),(102,17,6,0,'Following, grappled and tied, they are held fast. The King sacrifices and receives blessings on the Western Mountain.','It is a blunder to make a further move now. Disentangle yourself from the old ways and offer a sacrifice to your real ideals. Help renew the corruption of your predecessors. Complete this and the flow will open for all. Step outside the norms. Gather energy for a decisive new move.',25),(103,18,1,0,'Managing and straightening the Father’s Corruption. The offspring correct the faults of their predecessors. Adversity, the hungry souls and angry ghosts. Wise Words! Completing this opens the Way.','You must deal with the corruption of authority. Do not be impulsive. Correct yourself first. Disentangle from the old ways. If you let yourself be led you can realize the hidden potential. Co-operate with the ongoing process of change.',26),(104,18,2,1,'Managing the Mother’s Corruption. This is not an enabling Trial.','You must deal with the corruption of nourishment and care. You cannot do this by imposing your ideas. Put yourself into the center of this situation and find the flow. Do the inner work. Do not run after impossible desires. You are called to serve now. This can lead to real excellence. These goings and comings will release the energy now bound up in the past. Co-operate with the ongoing process of change.',52),(105,18,3,1,'Managing and straightening the Father’s Corruption. Small has cause for sorrow. Without the Great, you make a mistake.','You must deal with the corruption of authority. There will be regrets that you co-operated with it in the past. Have a real purpose. Connect with the flow of events and your understanding will be brightened. Those who approach you are not outlaws. Seek an alliance. Be open and provide what is needed.',4),(106,18,4,0,'Abundant Corrupting. You enrich the Father who is now dissolving. Go on like this and you will see Distress.','You are colluding with the corruption of authority. Do not simply adapt. Rely on your real experience and you acquire what you desire. Let the images of change circle within you. When the time is right you can act with confidence. If you co-operate with corrupt authorities now, you will be swept away with them when the great change comes. Be resolute. You are connected with a creative force.',50),(107,18,5,0,'Managing and straightening the Father’s Corruption. Use praise to accomplish the task.','You must deal with the corruption of authority. Disarm your opponents with praise. Let go of your self importance and adapt to what confronts you. Demonstrate your real worth. Do not initiate things, bring them to completion. You will be rewarded. Step outside the norms and re-imagine the situation. Co-operate with the ongoing process of change.',57),(108,18,6,1,'Do not involve yourself in the Corruption of the Kings and the Lords. Honoring what is highest is your affair.','These are the people who work on in the darkness to prepare the new dawn. Leave your old thoughts behind and mingle with the new influence. Have no fear. Do not pause in your efforts to find the true meaning of these changes. These goings and comings will release the energy now bound up in the past. If you let yourself be led you can realize the hidden potential. Co-operate with the ongoing process of change.',46),(109,19,1,1,'A conjunction is Nearing. Trial: Wise Words! The Way is open.','An inspiring connection comes nearer that belongs with you like the parts of a separated whole. The armies set out from here so do not obstruct their power with old forms and old thoughts Look into this deeply and measure yourself against the ideal of the Realizing Person who seeks to live life in accord with the flow. Something significant is returning. Be open and provide what is needed.',7),(110,19,2,1,'A conjunction is Nearing. Wise Words! The Way is open. Nothing not advantageous.','An inspiring connection comes nearer that belongs with you. This will benefit everything. Relax your grip and return to the flow. You will obtain the favor of the noble women and their secret connections. Look into this deeply. Measure yourself against the ideal of the Realizing Person, one who seeks to live life in accord with the Way. Be open and provide what is needed.',24),(111,19,3,0,'Sweetness is Nearing, but there is no advantageous direction. If you are already grieving, there will be no mistake.','This influence is not right for you. Let it go. Accept the hardship and drudgery and have no cares. You will soon find all you need. There is a real mission in this situation that you can cultivate in your retreat. You will soon see the new city shining. Step outside the norms and re-imagine the situation. Co-operate with the ongoing process of change.',11),(112,19,4,0,'The climax is Nearing. Release the spirit. This is not a mistake.','Give yourself fully to this influence. Draw out this encounter to find the right time to act. Firmly resist the temptation to act impulsively. Do not let your relationships fall apart through unconsidered action. Look into the origins of things and you will know the right time to act. Step outside the norms and re-imagine the situation. Co-operate with the ongoing process of change.',54),(113,19,5,0,'Knowledge is Nearing proper to a Great Leader. Wise Words! The Way is open.','You can use this influence to be of real help to others. Leave your usual sources of support and flee to the hidden springs of change. Look at things with a woman’s eye and articulate the new time with grace and elegance. You will be praised and rewarded. Be open and provide what is needed.',60),(114,19,6,0,'Generosity and wealth are Nearing. Wise Words! The Way opens. This is not a mistake.','Be generous with what you acquire and your desires will be fulfilled. This will not diminish you, it will augment you. Arouse and activate the great within. Watch the small things and let what you see move you for they presage the great change. Something important is returning now. Be open and provide what is needed.',41),(115,20,1,0,'Viewing the children playing. For Small People this is not a mistake. For the Realizing Person: Distress.','Watching the children play, you see signs that can disturb the whole state. Move with them. Arouse the great within you. Generosity and power can enter your life if you act on what you see. This will not diminish you, it will augment what you can offer. Something important is returning. Be open and provide what is needed.',42),(116,20,2,0,'Viewing through the patterned screen. Advantageous if the women divine. Harvesting.','Watch the hidden patterns and beware of falling into negative emotions. The knowledge proper to a great leader is approaching now. Articulate it quietly. Leave what usually supports you and flee to the hidden springs of change. Express yourself joyously and you can inspire others. Be open and provide what is needed.',59),(117,20,3,0,'Viewing our birth, advance or withdraw?','Look at the origin of the things you see to understand if you should advance or withdraw. The climax is nearing. Resist the temptation to act violently or impulsively. Draw out the encounter to find the right time to act. Do not let your relationships fall apart through unconsidered action. Proceed step by step. Gather energy for a decisive new move.',53),(118,20,4,0,'Viewing the city shining. Advantageous to be a guest when the King hosts the ancestors.','This connection can bring wealth and influence in the end. Do not try to take immediate advantage. It may look sweet, but no good can come of it. Accept the hardship. Have no cares. There is a hidden message in this obstruction that you must cultivate. Step outside the norms and re-imagine the situation. Gather energy for a decisive new move.',12),(119,20,5,1,'Viewing our birth. The Realizing Person makes no mistake.','Look deeply into this connection and measure yourself against the ideal of the Realizing Person who seeks to live life in accord with the flow. The spirit liberated now belongs with you like parts of a previously separated whole. Relax your grip and return to the flow. You will obtain the favor of the noble ladies and their secret connections. Strip away your old ideas. Be open and provide what is needed.',23),(120,20,6,1,'Viewing their birth. The Realizing Person makes no mistake.','Look deeply into this connection and measure yourself against the ideal of the Realizing Person, who seeks to live life in accord with the flow. The spirit liberated now belongs with you like parts of a previously separated whole. The armies set out from here. Do not obstruct their power with old forms and outmoded ways of communicating or the group that is emerging will have no real purpose. Strip away your old ideas. Be open and provide what is needed.',8),(121,21,1,1,'Shoes locked in a wooden stock, his feet disappear. This is not a mistake.','You have been locked up and cannot move. This is for your own good. Though you feel held back, there is a net of relations that connect you with a new time. Take time to reflect. Adorn things with purity and clarity. Step outside the norms. Gather energy for the decisive new move.',35),(122,21,2,0,'Biting through flesh, his nose disappears. This is not a mistake.','Do not be afraid of your enthusiasm. Confront the situation and you will find the hidden cause of things that are happening. Use it to care for all. What you have to offer may be small but it will be effective. Co-operate with the ongoing process of change.',38),(123,21,3,0,'Biting through dried meat, meeting poison. Small is distressed. This is not a mistake.','Biting through to union you encounter something old and poisonous. Bring it out. Beat your drums or you will end up lamenting like a very old person. The distress you feel will soon disappear.  Those who approach you now are not outlaws. Treat them with great respect and seek an alliance. Do not be afraid to act alone. You are connected with a creative force.',30),(124,21,4,1,'Biting through parched meat with bones. Acquiring a bronze arrow. Trial: Hardship is advantageous. Wise Words! The Way opens.','You can acquire the ability to act directly and effectively now.  Accept the drudgery. Eliminate corrupt old patterns and pursue your real desires. Do not reject this opportunity or you will languish for years. This could become an ever-flowing source of energy. Be open and provide what is needed.',27),(125,21,5,0,'Biting through parched meat. Acquiring bronze and gold. Trial: Going through adversity is advantageous. Confront the hungry souls and angry ghosts. This is not a mistake.','Getting through this is a long arduous task but you acquire wealth and connection in the end. Disentangle yourself from this sudden and unexpected affliction. See it as a spiritual problem, not a literal one and you will soon rejoice. You are carrying a hidden secret, something that can renew the place you live and work. Have patience. Gather energy for a decisive move.',25),(126,21,6,1,'Why are you locking yourself in a wooden stock so your ears disappear? Trap! The Way closes.','You have cut yourself off and will not listen. Do not be infected by this old fear and confusion. Do the inner work and do not keep running after impossible desires. There is an ever-flowing source of energy available now. Adorn yourself with courage and set out on your own. Step outside the norms and re-imagine the situation Gather energy for a decisive new move.',51),(127,22,1,1,'Adorn your feet. Leave the chariot and go on foot.','Adorn yourself with courage and independence. Make your own way.  You have been seriously punished. Try to hear the lesson. Do not be infected by other people’s fear and confusion. Do the inner work and do not keep running after impossible things. Stabilize your desires. There is an ever-flowing source of energy available now. Co-operate with the ongoing process of change.',52),(128,22,2,0,'Adorning your growing hair or beard. Have patience.','You have a connection to a superior that will lift you into a better life. Biting through the obstacles is an arduous task but in the end you acquire something of great value. Disentangle yourself from the unexpected affliction. Take it as a spiritual problem and not a literal one and you will soon have cause to rejoice. Let yourself be led and you can realize the hidden potential. Co-operate with the ongoing process of change.',26),(129,22,3,1,'Adorned and sleek, impregnate yourself with this. Trial: Wise Words! This is an ever-flowing Way.','This can open the way for you and all your descendents. Biting through the obstacles is a long, arduous task but the drudgery will be worth it in the end. Eliminate corrupt old patterns and pursue your real desires. Do not reject this opportunity or you will be cut off for years. This can open the way for you and everything you wish for. Be open and provide what is needed.',27),(130,22,4,0,'Adorned and venerable, they ride the soaring white horse. Those you encounter are definitely not outlaws. Seek the marriage alliance.','Attribute great wisdom and worth to this connection. It can be an ever-flowing source of energy and inspiration. Bring out what is hidden. Beat your drums now or you will end up lamenting your life. Any distress you might feel will flare up and disappear. Do not be afraid to act alone. You are connected to a creative force.',30),(131,22,5,0,'Adorning in the hilltop garden. The marriage gifts. The roll of plain silk is little, little. Distress. Wise Words! Completing this opens the Way.','You are asked to become a member of a great organization. Though you feel you have little to offer go through with this. Do not be afraid of your enthusiasm. If you confront the situation you can find the hidden power that will lead to what you desire. Use what you receive for the good of all. Gather energy for the decisive new move.',37),(132,22,6,1,'Adorned in white. This is not a mistake.','Bring out the essentials. Be clear and pure. Adorn yourself in real virtue. Trying to control the situation prematurely, you were locked up and could not move. This was for your own good. Have no fear. The time of darkening is coming to an end. You will soon emerge and be recognized. These goings and comings release the energy now bound up in the past. Co-operate with the ongoing process of change.',36),(133,23,1,0,'Change the bed by using the stand. Ignoring the Trial: Trap! The Way closes.','Change your base and what supports you. Confront the old delusions. Do not ignore the challenge. You must overcome the seductive delusions of wealth and power or all you care for will be destroyed. This is a time of radical transformation. Strip away your old ideas. Be open and provide what is needed.',27),(134,23,2,0,'Change the bed by marking things off. Ignoring the Trial: Trap! The Way closes.','Differentiate yourself from others and dissolve negative projections. You have the power to revitalize the dwelling now. Embrace the feminine and work through the small. Find the vital power of inner growth and circulate it to all. As the time renews itself give with open arms. Be open and provide what is needed.',4),(135,23,3,0,'Strip it away! This is not a mistake.','Take decisive action now.  It is imperative you strip away old limits and outmoded, repressive ideas for the bitter smoke that arises from them is smothering your heart. Co-operate with the ongoing process of change.',52),(136,23,4,0,'Changing the bed, cutting close to the flesh. Trap! The Way closes.','You are carried away with the renovation of your life, about to do serious harm. Pull back from the crisis. Do not overreact to your previous timidity and fear. You have found the central illusion causing the disorder that troubles you. This will free you from affliction but you must act slowly and carefully to realize it. Accept the difficult task. These comings and goings will release bound energy. Co-operate with the ongoing process of change.',35),(137,23,5,0,'Thread the fish by the gills. You obtain the favor of the palace women. Nothing not advantageous.','Use your connections and trust your imagination, for the spirit is re-emerging. There is profit and fertility hidden in the stream of events. Watch for the signs of its emergence. Connect yourself to the ideal of the Realizing Person who seeks to live life in accord with the flow and you will make no mistakes. Something important is returning now. Be open and provide what is needed.',20),(138,23,6,1,'A ripe fruit not eaten. The Realizing Person acquires a cart. Small People merely Strip their faces.','This is a time of radical transformation. Step out to meet it. Take in the fruits of your actions, move on and carry them away. You may have been keeping at a distance because of pain or isolation but now is the time to let it go. Proceed step by step. Be open and provide what is needed.',2),(139,24,1,1,'Not distancing the Return. No harm or cause for sorrow. The Way to the Source is open.','You have stripped away the outmoded and found the new. Now take in the fruits of your actions. Do not go back to your old ways. Move on and carry it all away with you. You can connect with a deep source of energy. Be open and provide what is needed.',2),(140,24,2,0,'Released and Returning. Let it go! Wise Words! The Way is open.','There is profit and fertility hidden in the stream of events now. Use these connections and trust your imagination. There is nothing that will not benefit from this. Connect yourself to the ideal of the Realizing Person who seeks to live life in accord with the flow. Be open and provide what is needed.',19),(141,24,3,0,'Returning from the brink, pressing and urgent. Face the adversity, the hungry souls and angry ghosts. This is not a mistake.','You confront danger with its roots in the past. You have found the central illusion causing the disorder. This will free you from affliction, but you must act slowly and carefully to realize it. Pull back from your sense of crisis. Hide your light and accept the difficult task. These goings and comings release the energy now bound up in the past. Co-operate with the ongoing process of change.',36),(142,24,4,0,'The center is moving. Return alone.','Move with this even if you must go on alone. By taking decisive action you can renew yourself and all your relations. Strip away old limits and repressive ideas, for the bitter smoke that rises from them is smothering your heart. Take action. Step outside the norms and re-imagine the situation. Gather energy for the decisive new move.',51),(143,24,5,0,'Generous Return. Returning from a triumph. No cause for sorrow.','You have to confront basic questions of support and intimacy, the place where you feel at home. Strip away the old. Differentiate yourself from others and dissolve negative projections. You have the power to revitalize the dwelling now. Embrace the feminine. Reach back to the vital power of inner growth and circulate it to all. This is an omen of generosity and real joy. Be open and provide what is needed.',3),(144,24,6,0,'Delusion Returning. Calamities and blunders. If you try to move the legions like this it will end in great destruction. Trap! The Way closes for the city and its Leader. This will end in ten years of uncontrolled chastisement.','You must confront basic questions of support and intimacy. Take a stand for change. Do not ignore the message. Decisively confront and overcome the seductive delusions of wealth, power and fear. Strip away the old and you will be nourished at the source.',27),(145,25,1,1,'An unexpected encounter. Wise Words! Go on, the Way is open.','What looks like an unfortunate incident may turn out to be heaven’s highway. Take vigorous action to find those with whom you belong. The walls of the old city are falling now, but this distress is a message from the center. Do not use force. Collect the energy and insight to start anew. Gather energy for the decisive new move.',12),(146,25,2,0,'They don’t till, but they have a harvest. They don’t clear the land, but have fields to plant. Advantageous to have a place to go. Harvesting.','If you realize what this time means, all your plans will succeed. Smooth the way from the shadows. You have a hidden connection that binds you to others. Empty your mind of immediate goals. Supportive friends will soon arrive. Step out to meet the new destiny.  You can confront and disable a powerful and malevolent opponent. Gather energy for a decisive new move.',10),(147,25,3,0,'Someone has tethered cattle. If the moving people take them, it is the capital people’s disaster.','If you stay where you are, this is a disaster. Go into retreat and prepare a countermove. This may isolate you, but in the end you will definitely succeed. Accumulate the strength to carry heavy loads and confront difficult situations. Unite with others for a common goal. You are coupled with a creative force.',13),(148,25,4,1,'Disentangling. An enabling trial. This is not a mistake.','Go through with what you contemplate. The center of life is moving, so pursue your goals. You will soon find a real friend and lose a false one. The hardship you confront will be advantageous in the end. You can disentangle yourself from past mistakes. Be open and provide what is needed.',42),(149,25,5,1,'Disentangling from an unexpected affliction. If you do not use medicine you will soon rejoice.','Though you may be in pain, do not treat it literally. Treat it spiritually and you will soon have cause to rejoice. Bite through the obstacles to union. You are carrying something valuable. Have patience. These goings and comings will release the energy now bound up in the past. Step outside the norms and re-imagine the situation. Gather energy for the decisive new move.',21),(150,25,6,1,'It is a blunder to make a move now. No advantageous direction.','You have followed this path as far as you can. It is time to face the corruption of the past. Dedicate yourself to your highest ideals. Step out to meet your new destiny. Gather energy for a decisive new move.',17),(151,26,1,1,'Adversity, the hungry souls and angry ghosts. Advantageous to end this. Offer a sacrifice to Heaven.','It is a blunder to go on in the old way. It would mean disaster and exhaustion. You have followed this spirit as far as you can go. Confront the corruption of the predecessors and correct their faults. Complete this! If you let yourself be led, you can realize the hidden potential. Co-operate with the ongoing process of change.',18),(152,26,2,1,'Great Accumulates. Loosen the cart’s axle-straps. Say it this way: you are carrying hidden cargo. Draw round the carts and make a barrier each night.','You are carrying something precious, a new possibility that can be of help to all. The connection to a superior person is already there. Though you may be in pain do not treat it as a literal problem. See it imaginatively and spiritually and you will soon have cause to rejoice. Be brave and patient. These goings and comings will release the energy now bound up in the past. Co-operate with the ongoing process of change.',22),(153,26,3,1,'Great Accumulates. Fine horses in pursuit. Trial: Hardship is advantageous. Advantageous to have a direction to go.','This is an enabling divination. Pursue your plans and ideals. You can disentangle yourself from the past and free yourself from mistakes. The center of life is moving.  You will acquire a real friend and lose a false one. Something important is returning. Be open and provide what is needed.',41),(154,26,4,0,'Great Accumulates. A horn-board for the young bull. Wise Words! The Way to the Source is open.','Even though you are without blame you feel you have lost something precious. See this difficult situation as a chance to move on from an old position. By taking precautions now you can accumulate new strength. Do not seek dominance. Retreat and prepare the countermove. This may isolate you but in the end you will succeed. Be resolute and part from the past. You are connected to a creative force.',14),(155,26,5,0,'Great Accumulates. A gelded boar’s tusks and a thorn hedge. Wise Words! The Way is open.','By taking precautions now you can disable a powerful opponent. Empty your mind of immediate goals. Go into retreat and use your hidden connections. Step outside the norms and re-imagine the situation. This brings great rewards in the end. Co-operate with the ongoing process of change.',9),(156,26,6,1,'Could this be Heaven’s Highway? You receive the Blessing. Make an offering and you will succeed.','There is no doubt about your success. Disentangle yourself from the sorrows of the past and go forward. Let old structures dissolve and take vigorous action to find those you belong with. Collect the energy and insight to start anew. A flourishing time is coming. If you let yourself be led, you can realize the hidden potential. Cooperate with the ongoing process of change. ',11),(157,27,1,1,'Abandoned by the Numinous Turtle, you say: View our jaws hanging down. Trap! The Way closes. Take this in!','You reject your own imagination and creativity and fall into melancholy. Strip all this away. Change the place you find support and intimacy by changing your stand on things. The cause for sorrow will disappear. If you use force in the outer world you will not overcome the opposition you face. Be open and provide what is needed.',23),(158,27,2,0,'Shaking the Jaws, clearing the channels, rejecting the rules. Move to the hilltop shrine and make an offering. Chastising closes the Way. Take this in!','Shake things up and move to your hidden place of inspiration. Do not discipline people or set out on an expedition. Diminishing your forward drive will augment you in the end. A hasty move leads to nothing but trouble. Something important is returning. Be open and provide what is needed.',41),(159,27,3,0,'Rejecting the Jaws. Trial: Trap! The Way closes. If you go on like this you will not be able to act for ten years. Take it in! There is no advantageous direction.','You are rejecting the source of nourishment. You beat yourself against impossible obstacles and grasp at what can only hurt you. Let go of these ideas. If you go on like this the structure of your life will buckle and fail. This could be an ever-flowing source of energy. These comings and goings release energy now bound up in the past. Co-operate with the ongoing process of change.',22),(160,27,4,0,'Shaking the Jaws. The Way is open. This is not a mistake. A Tiger observing, glaring, glaring; pursuing, pursuing the dark desires.','The source of nourishment is disturbed. Passionately search out the new. Bite through the obstacles to union. This is an arduous task but you will acquire something of great value in the end. Do the inner work. If you do not add more, your life will be crowned anew. These goings and comings release energy bound in the past. Gather energy for a decisive new move.',21),(161,27,5,0,'Clearing the channels. Rejecting the rules. Trial: Wise Words! Staying in your residence opens the Way. This does not let you step into the Great Stream. Take it in!','Stay where you are and clear the channels through which energy flows. You have a connection to the spirit and a benevolent heart. Let this be your way to actualize things. Imagine this time through the feminine and receptive rather than the masculine and aggressive and a flowering will result, a real burst of beauty. Strip away your old ideas. Be open and provide what is needed.',42),(162,27,6,1,'Jaws. Nourished at the source. You face Adversity, the hungry souls and angry ghosts. Wise Words! The Way is open. Take it in! Advantageous to step into the Great Stream.','You are nourished by what came before you. Go back and correct things. An old delusion is returning, the desire for wealth and power. If you set the armies marching like this you face disaster. Couple vigorously with the inner influence. If you simply step into the troubled waters in front of you now, you will be swept away. Be open and provide what is needed.',24),(163,28,1,0,'Offer the sacrifice using a mat of white mao-grass. This is not a mistake.','When you look at your problems you fall into self-pity reject your creative power. Prepare your beginnings. Be simple, humble and pure. Change the place you find support by changing your stand on things. All cause for sorrow will disappear. If you use force you will not win. Be resolute and part from the past. You are connected to a creative force.',43),(164,28,2,1,'A withered willow gives birth to a shoot. An older husband acquires a younger consort. Nothing not advantageous.','In the midst of a crisis something happens that gives everything a new lease on life. Shake things up and clear the channels through which spirit and energy flow. Do not discipline people or set out on an expedition now. Diminishing your forward drive will augment you in the end. A hasty move will lead to nothing but trouble. You are coupled with a creative force.',31),(165,28,3,1,'The ridgepole warps and buckles. Trap! The Way closes.','The structure of your life is failing. You are rejecting the real sources of nourishment. Do not beat yourself against impossible obstacles and grasp at things that can only hurt you. This could be an ever-flowing source of energy. Find supportive friends. Gather the energy for a decisive new move.',47),(166,28,4,1,'The ridgepole is crowned. Wise Words! The Way is open. If you try to add more, there will be distress.','You have come through the great transition. If you do not add more, your life will be crowned anew. Clear the sources of nourishment.  Bite through obstacles to union. This is a time of inner preparation that lets you connect with the common good. If you let yourself be led you can realize hidden potential. Co-operate with the ongoing process of change.',48),(167,28,5,1,'A withered willow gives birth to flowers. An older wife acquires a young noble as husband. Bundled in the bag. Without mistake, without praise.','Something occurs that results in a burst of beauty. This clears the channels through which energy flows. Enjoy it. Reject the rules most people live by. Imagine this through the woman and the receptive and it will endure. You have a generous and benevolent heart. Let it be your way to actualize things.  Be resolute. You are connected to a creative force.',32),(168,28,6,0,'If you exceed stepping in to the water now, you will be submerged to the top of your head. Trap! The Way closes. Do not make this mistake and the cause for sorrow will disappear.','These are deep and troubled waters. Do not be swept away. An old delusion is returning, the need for wealth and power. If you set the armies marching like this you face disaster. Do the inner work. If you do not act this out the cause for sorrow will disappear. Be resolute. You are connected to a creative force.',44),(169,29,1,0,'Repeating the Pit.  Entering the pitfall. Trap! The Way closes.','By responding in the same way again and again you fall into depression and melancholy. Do not get caught here. Do not leave your inner place. If you make a move now your journey will end in fragments. The omens are good for beginnings, so plan a new start. Take things in. Be open and provide what is needed.',60),(170,29,2,1,'A Pit with sheer sides. Seek and acquire through the Small.','As you venture into danger you will get what you need by being flexible and adaptable. Have modest goals. Keep your sense of purpose. Do not impose your will. Your connection puts you at the center of this group. Adapt to what confronts you. Do not let this opportunity slip through your fingers. Use an inspiring idea to carry your desires. Energy and power will surge up from below. Strip away your old ideas.',8),(171,29,3,0,'They come into the Pit again and again. Steep and deep, the victims are drowning. Do not get trapped in this pitfall!','Relax and pull back. If you simply push on you will be trapped. The source of common values is disturbed and turbid. You feel the sorrow of someone who is connected to the sources of life but has no one with whom to share. As you bite through the obstacles to union you will encounter something poisonous. Bring it out or you will end up lamenting. Let yourself be led and you can realize the hidden potential. Co-operate with the on-going process of change.',48),(172,29,4,0,'Set out wine in a flask and two sacrificial bowls. Use the earthen vessels. Let in the bonds that come through the window. Complete this! It is not a mistake.','You are trapped but do not fight the situation. Your rescuers are coming. You are right on the border, the place where events emerge. Though you are confined by a host of oppressive duties they will slowly loosen. Concentrate on your real ideals. The people approaching you are not outlaws. Attribute great wisdom to the connection. You will find supportive friends. Gather energy for a decisive new move.',47),(173,29,5,1,'The Pit is not full.  The Earth Spirit is already appeased. This is not a mistake.','The difficult time is over. Be happy with your release. The decisive encounter approaches and you are assured of victory. Get rid of old ideas and bad memories. Enter the battle and seize the enemy. People are coming together now after a time of loneliness and separation. Great Leaders meet to mutualize their power for the good of all. Let your tears flow like rivers for this will release you from the past. Something important is returning.',7),(174,29,6,0,'Tied with stranded ropes, sent away to the dense thorn hedges. For three years you will see nothing. Trap! The Way closes.','If you go on as you are you will be bound, judged and imprisoned. Change now! Disperse the bad blood or your melancholy and pain will trap you. Eliminate the negativity and there will be excellent results. Be open and provide what is needed.',59),(175,30,1,1,'Treading crosswise. Honor the Bright Omen! This is not a mistake.','Be very careful with the first steps. Polish and clarify your motives. If you respond the same way again and again you will be caught in the tomb of melancholy. If you make an impulsive move you face disaster. Search outside the norms. Do not be afraid to act alone. You are connected with a creative force.',56),(176,30,2,0,'Yellow Radiance. Wise Words! The Way to the Source is open.','You have found the connection. Light and power surge up from below. As you venture into danger you will get what you need by being flexible and adaptable. Gather people around you and do not impose your will. You are at the center of this group. Do not let this chance slip through your fingers. Use an inspiring idea to carry your desires. Be resolute. You are connected with a creative force.',14),(177,30,3,1,'The setting sun’s Radiance. If you do not beat the clay drum and sing, you will lament like a Great old person. Alas! Trap! The Way closes.','You see everything in the light of the setting sun. If you do not beat your drums now you will end up lamenting. Do not push on into your melancholy. The source of common values is disturbed. You feel the sorrow of someone who is connected to the source of life but has no one to share it with. As you bite through the obstacles to union you will encounter something poisonous. Bring it out! Proceed step by step. Gather energy for a decisive new move.',21),(178,30,4,1,'It comes suddenly, flares up and dies out. This is an image of what can be abandoned.','This anxiety comes suddenly, burns up and dies out. You can simply throw it away. You may feel trapped but do not fight the situation. The oppressive duties that confine you will slowly loosen. The people approaching you now are not outlaws. Attribute great wisdom and worth to them. Seek an alliance. These goings and comings release the energy bound up in the past. Step outside the norms and re-imagine the situation. Gather energy for a decisive new move.',22),(179,30,5,0,'Tears flowing like rivers, lamenting like mourners at a funeral. Wise Words! The Way opens.','It feels as if you have lost a connection with someone important. Let your sadness be seen. The decisive encounter approaches and you are assured of victory. Get rid of old ideas and bad memories. People are coming together after a time of loneliness and separation. The great leaders meet to mutualize their power for the good of all. You will soon find supportive friends. You are coupled with a creative force.',13),(180,30,6,1,'The King sets out on campaign. There will be excellent results. Sever the heads, offer the rebel chiefs in sacrifice. Put them to the question. This is not a mistake.','Take aggressive measures. Something harmful has occurred and you must deal with it.  Seize what is truly important. If you go on in the old ways now you will be bound, judged and imprisoned. Disperse the bad blood. Do not stay in mourning for the past.  A time of abundance is coming. You are coupled with a creative force.',55),(181,31,1,0,'It conjoins your big toes.','You feel the first stirrings of creative desire. The influence is just beginning. It will change the way you see your life. Begin the inner journey. Beware of trying to see too much, too soon. You are coupled with a creative force.',49),(182,31,2,0,'It conjoins your calves. Trap! The Way closes. Wise Words! Abide in the dwelling and open the Way.','Do not get swept off your feet by this powerful influx. A hasty move now will lead to nothing but trouble.  Stay right where you are and you will soon have what you want. You are surrounded by omens of rebirth and beauty.  Act through the receptive, not the aggressive. All cause for sorrow will disappear. You are coupled with a creative force.',28),(183,31,3,1,'It conjoins your thighs. Hold on to your following! Going on brings distress.','You are in danger of becoming obsessed by this influence. If you go on running after it you will be covered in distress. Every time you try to gather the people for a great project it will end in lamentation. Give this sort of effort up. Let go of the past and focus on your real ideals. There is no game in the field for you now. Open your heart to the new spirit. Gather energy for a decisive new move.',45),(184,31,4,1,'Trial: Wise Words! The Way is open. The cause of sorrow disappears. You waver back and forth, “going and coming.” Partners will simply follow your thoughts.','This is a very favorable influence. You go back and forth in your thoughts trying to understand it. Have no fear. Friends will be there to help you. Express your aims and desires. Difficulties are going, the connection is coming. Release yourself from your sense of burden and your desperate need for privilege. Step outside the norms. Gather energy for a decisive new move.',39),(185,31,5,1,'It conjoins your neck, moves along the spine. No cause for sorrow.','This is a very deep connection that will endure over time. You are feeling the beginnings now. The shrouding clouds bring no rain yet but the hidden connection is made. Be flexible and adapt. Identify with the mothers and the servants, not the fathers and leaders. Do not be afraid to act alone. You are coupled with a creative force.',62),(186,31,6,0,'It conjoins your jaws, cheeks and tongue.','This influence inspires you to burst forth in passionate speech. It may not last long. Though you can give voice to what inspires you, there is greater fertility in staying in retreat. Do not try to set others in order or launch an expedition. The energy is there but it must be nurtured. If you set forth now you will fall into the abyss.  You are coupled with a creative force.',33),(187,32,1,0,'Deepening Persevering. You try to fix the swirling waters. Trial: Trap! The Way closes. There is no advantageous direction.','You are trying to fix this influence too soon. This is the wrong way to go about it. Nothing you come up with can help you. Hold back for now. There is greater fertility in retreat. Do not try to set others in order or launch an expedition. The connection is there but it must be nurtured. Be resolute in this. You are coupled with a creative force.',34),(188,32,2,1,'Persevering. Fix the omen. The cause of sorrow disappears.','If you persevere in what you have established your sorrows will disappear. The power and the ability are there. Commit yourself. You have a deep connection that will endure over time and wipe away past sorrows. You are now feeling the beginnings. Be small. Identify with the mothers and the servants, not the fathers and the leaders. Do not be afraid to act alone. You are coupled with a creative force.',62),(189,32,3,1,'Not Persevering in power and virtue. Someone gives you a gift and even then you are embarrassed. Trial: Distress.','You are betraying your own promise. Everything will lead to your embarrassment because you cannot keep your heart steady. You go back and forth in your thoughts trying to understand things. Have no fear. Difficulties are going, the connection is coming. Your friends will be there for you. Do not keep beating yourself against impossible obstacles. Deliver yourself from your sense of burden and your need for privilege. Co-operate with the ongoing process of change.',40),(190,32,4,1,'Trying to fix the omen when there is no game in the fields.','There is no game in sight, no possibility of connection. Restrain your impulses and leave quietly. Hold on to what supports you. Let the present situation dissolve and think about your real ideals. If you let yourself be led you can realize the hidden potential. Co-operate with the ongoing process of change.',46),(191,32,5,0,'Persevering in power and virtue. Fix the omen. Trial: Wise Words! The Way opens through the Wife. The Way closes through the Husband.','Persevere in real virtue. This is a favorable situation if you act through the receptive. Do not be swept off your feet. If you insist on dominance you will be cut off and fall into a trap. A hasty move now will lead to nothing but trouble.  Stay right where you are and you will soon have all you want. You are surrounded by omens of rebirth and beauty. You are connected to a creative force.',28),(192,32,6,0,'You try to fix the distant horizons. Trap! The Way closes.','You cannot make anything endure like this. The support is not there. Find an image of what truly endures and give up trying to control the future. You feel the stirrings of creative desire, but this influence is just beginning. Begin the inner journey. Let the transformation find its own way and time. Be resolute and part from the past. You are connected to a creative force.',50),(193,33,1,0,'Retiring at the tail. Adversity, the hungry souls and angry ghosts. Make the sacrifice. Do not act. Have a direction to go.','You are caught up in old plans and old promises. You cannot cut through them yet, but be ready. The people are gathering at the gate, poised at the threshold. Though you are stuck at the moment and in for a bit of hard work, the fault will not last long. Accept the hardship. Have no fear. Heaven is shielding the birth of this new group. You are coupled with a creative force.',13),(194,33,2,0,'Held in the yellow bull’s skin. Absolutely nothing can succeed in loosening this.','This is an inner retreat through which you see into things. Do not let go of what you see. It is your purpose and truly belongs with you. Your ideas have borne fruit and the womb is full. Stay quiet for now. If you can change your considerable strength into imagination you will soon regain what you feel you have lost. You are coupled with a creative force.',44),(195,33,3,1,'Tied Retiring. There is affliction and adversity, the hungry souls and angry ghosts. Accumulate servants and concubines to deal with them. The Way opens.','You are entangled in a web of difficulties. You cannot get out of this alone so let others help you. Do not be a victim.  You are acting like a young bird afraid to leave the nest but the inner strength is there. You can use your neighbor’s wealth. Proceed step by step. Gather energy for a decisive new move.',12),(196,33,4,1,'Love and goodness come to the Realizing Person through Retiring. Follow the Woman. Wise Words! The Way opens. Small People are obstructed.','Goodness and love come through retiring now. Think about what you truly care for. Keep greedy people who are eager to serve you at a distance. You have found a resting place after a transition. This is a portent of future happiness. Have patience. If you use strategy and an open heart rather than aggression it will let you gain the correct position. Proceed step by step.  Gather energy for a decisive new move.',53),(197,33,5,1,'Excellence comes through Retiring. Trial: Wise Words! The Way is open.','Excellence comes through this retreat. Have no regrets. You make the connection with a single try. Though you may feel isolated and unsure, you have a profound connection that is working at a great distance. Do not be afraid to stand alone. You are coupled with a creative force.',56),(198,33,6,1,'Wealth and fertility come through Retiring. There is nothing that is not advantageous.','By retiring now you bring wealth and fertility to everything around you. You may want to break forth into passionate speech but do not forget the lessons you learned hidden in retreat. If you try to fix this prematurely you will be lost. Hold back for now. The energy is there but start slowly. You are coupled with a creative force.',31),(199,34,1,1,'Great Invigorating Strength in the feet. Trap! Chastising closes the Way. There is a connection to the spirits that will carry you through.','Hold back for now. Do not try to tell other people what to do or set out on an expedition. By retiring you can bring wealth and fertility to everything around you. The energy is there but if you act prematurely you will be lost in the abyss. Be resolute and part from the past. You are connected to a creative force.',32),(200,34,2,1,'Drive the animals forward. Wise Words! Trial: The Way is open.','Drive on. Whatever you want to do now will succeed. You motives are straight and your strength is adequate to the task.   You may feel isolated and unsure but you have a profound connection working at a great distance that will bring a time of blessing. Do not be afraid to act alone. You are coupled to a creative force.',55),(201,34,3,1,'Small People use Great Strength. The Realizing Person uses the empty spaces of a net. Trial: Adversity, the hungry souls and angry ghosts. The ram butts a hedge and entangles his horns.','Do not use force now. Use strategy and an open heart. You are confronting troublesome past experiences. If you try to force things you will only become entangled. Think about what you truly care for and keep greedy people at a distance. This is a portent of future happiness. If you let yourself be led now you can realize the hidden potential. Co-operate with the on-going process of change.',54),(202,34,4,1,'Great Invigorating Strength. Wise Words! Trial: The Way is open. The cause for sorrow disappears. The hedge is broken through, no more entanglement. Invigorate the axles of the great war chariots.','The obstacle vanishes. There is nothing holding you back. Do the great things that are in you to do. Trying to retire you were caught in a web of difficulties. Now you are like a young bird afraid to leave the nest. Act on your heart’s desire. A flourishing time approaches. If you let yourself be led you can realize the hidden potential. Co-operate with the on-going process of change.',11),(203,34,5,0,'He loses his flocks. We change with ease. Without a cause for sorrow.','Let go of forward drive. Change your considerable strength into imagination. Do not always charge into obstacles. An inner retreat now will let you see into things. Do not let go of what you see for it is your purpose and belongs with you. Be resolute. You are connected to a creative force.',43),(204,34,6,0,'The ram butts a hedge. He cannot pull back and he cannot push through. There is no advantageous direction. Wise Words! Accept the hardship and you will open the Way.','You are caught in a web of old plans and old promises and cannot cut through them immediately. Accept this hardship. Analyze your mistakes. The people are gathered at the gate, poised at the threshold. Heaven shields the birth of this group. Be resolute and part from the past. You are connected to a creative force.',14),(205,35,1,0,'Flourishing, advancing with brandished weapons. Wise Words! Trial: The Way is open. There is a net of relations that connect to the spirits. You will be enriched. This is not a mistake.','Trying to control the situation prematurely, you have been locked up and cannot move. Do not fear. You are connected to others through a net of spiritual relations. Be simple and pure. This situation will enrich you in the end. These goings and comings will release the energy now bound up in the past. Gather your forces for a decisive new move.',21),(206,35,2,0,'Flourishing, then apprehensive. Wise Words! Trial: The Way is open. Accept this fine armor and the blessing of the Queen Mother.','You feel anxious and sorrowful. Do not fear. Take on this arduous task and receive the blessing of the feminine powers. Let yourself be lured into action. Your sincerity and dedication are what count.  The situation seems difficult, but you will survive. This will bring profit and insight in the end. Gather energy for a decisive new move.',64),(207,35,3,0,'The crowds are loyal and sincere. The cause for sorrow disappears.','Everything is in order. People have confidence in you. Give of yourself unstintingly. Your sorrows will vanish. If you confront the past now, you will see the hidden force moving these events. Go right to the heart of the situation and reclaim your lost intelligence. Do not be afraid to act alone. You are connected to a creative force.',56),(208,35,4,1,'Advancing like a bushy-tailed mouse. Trial: Adversity, the hungry souls and angry ghosts.','Though you have the strength to advance you are being timid and furtive. Greedy people and bad memories attack you. Pull back from the crisis. Do not get caught in negative emotions. You will find the central illusion that is causing this chaos. It will act slowly but it will release you from what afflicts you. Strip away old ideas. Be open and provide what is needed.',23),(209,35,5,0,'The cause for sorrow disappears. Letting go or acquiring, have no cares. Go on, the Way is open. There is nothing that is not advantageous.','Let your sun shine on all. All your sorrows will vanish.  Simply give yourself to the work. Everything will benefit from this endeavor. Imagine you are in a quiet rural retreat. Attach your problems to this deep and quiet source. Mobilize your spirit. This hardship at the beginning is not a mistake. You will share the blessing. Proceed step by step. Gather energy for a decisive new move.',12),(210,35,6,1,'Flourishing with lowered horns. Adversity, the hungry souls and angry ghosts. Hold fast and attack the capital.  Wise Words! The Way is open. Trial for distress: This is not a mistake.','You can control this situation through direct action but you must first confront the negative images you have of things. You are escaping from an impossible situation. You can influence people if you master your words. Work on in the dark to provide for the future. An unconscious force is biting through to help you. These comings and goings will release energy now bound up in the past. Gather your forces for the decisive new move.',16),(211,36,1,1,'Hiding your Brightness through flight. Dipping your wings in the waters. The Realizing Person goes three days without eating. Have a direction to go. Master your words and you can influence others.','You are escaping from an impossible situation. You can convince people if you master your words. Work on in the dark to provide for the future. An unconscious animal force is biting through to aid you. These goings and comings will release the energy now bound up in the past. Co-operate with the on-going process of change.',15),(212,36,2,0,'Hidden and hurt in the left thigh. Use a horse to rescue this. Wise Words! Invigorating strength opens the Way.','You have received a serious but not deadly wound. Mobilize your spirit and come to the rescue. Simply give yourself to this work and your sorrows will vanish. Imagine you are in a quiet rural retreat. Attach your problems to this deep source and let go of your despair. If you let yourself be led now you can realize the hidden potential. Co-operate with the on-going process of change.',11),(213,36,3,1,'Hiding your Brightness in the southern hunt. Hounding them, you acquire their Great Head. Trial: This does not allow affliction.','In the midst of considerable difficulties you find the central illusion that is causing the chaos. Though this may act slowly it will release you from the sadness that afflicts you. Do not be timid and furtive or compensate through violent aggression.  If you get carried away in your attempts to renovate your life you will do serious harm. Something important is returning. Be open and provide what is needed.',24),(214,36,4,0,'Enter the left belly. Catch the heart of the Hidden Brightness. Issue forth from the gate and chamber.','You find center of the darkness obscuring you. Go right to the heart of it and reclaim your lost intelligence. People have confidence in you. Do not hold back. If you confront the situation you will meet the hidden force moving these dire events. Do not be afraid to act alone. You are connected with a creative force.',55),(215,36,5,0,'Jizi Hides his Brightness. Advantageous Trial. Harvesting.','You must pretend to be a part of this situation without losing your integrity. Be clear about what is happening. Though you may be apprehensive take on this difficult task and receive the blessings of the feminine. Let yourself be lured into action. The sincerity of your feeling and your dedication are what count now. Co-operate with the on-going process of change.',63),(216,36,6,0,'A time of brightening, a time of darkening. First it mounts to Heaven, then it enters the Earth.','The tyrant falls, the darkening ends. Though you feel held back, have no fear. You are connected to others through a net of spiritual relations. You have been locked up and cannot move for now, but this is for your own good.  Be simple and pure. You can renovate this corrupt situation. Co-operate with the on-going process of change.',22),(217,37,1,1,'Through enclosing there is a Dwelling. The cause for sorrow disappears.','Stay inside your dwelling and the secure group it represents. Rid yourself of negative feelings. These are the first steps on the path to union. The people you confront are not outlaws. Reach out and seek an alliance. The rain will come to wash the past away. Proceed step by step. Gather energy for the decisive new move.',53),(218,37,2,0,'Have no concern for achievements or glory. Locate yourself in the center of the Dwelling and feed the people. Wise Words! Trial: The Way is open.','You are the center of this group. Give unselfishly and nourish those around you. Return to the flow and part from the past. You have found what frees you from isolation. Step outside the norms and re-imagine the situation. Co-operate with the ongoing process of change.',9),(219,37,3,1,'Dwelling people, scolding, scolding. Repent the past sorrow and adversity. Wise Words! The Way opens. If wife and son are giggling, giggling, going on will bring distress.','You must establish order in the family. Repent past mistakes. Make sure people know their roles. The center of life is moving now and you can depend on being a part of it.  You will soon find a real friend. What you have in your heart will come to pass. Strip away your old ideas. Be open and provide what is needed.',42),(220,37,4,0,'Affluence flows from this Dwelling. Wise Words! The Great Way is open.','Goodness and abundance flow in this dwelling. Make it serve a real purpose. Stay in your group of friends and nothing can harm you. This will reverse what looks like an oppressive position. Offer what you have to the highest good. Do not be a victim of the past. You are coupled with a creative force.',13),(221,37,5,1,'The King approaches his Dwelling Altar to receive the Ancestor’s blessings. Care for the myriad beings. Wise Words! This opens the Way.','Extend the gift you have received to others even though it may be small. Bite through the obstacles to union. You have met something of great importance that will enter your heart and make everything clear. These goings and comings release the energy bound in the past. Co-operate with the ongoing process of change.',22),(222,37,6,1,'Majestic and resplendent. You have a connection to the spirits that impresses others. Wise Words! Completing this opens the Way.','This dwelling is full of power and blessings. Do not let negative feelings influence you. Keep your thoughts warm and clear. Harmony, strength and love will return of themselves. Any sorrow and disconnection you feel will vanish. Co-operate with the ongoing process of change.',63),(223,38,1,1,'Diverging. The Shadow Lands. The cause for sorrow disappears. You lose your horse. Do not pursue it. It returns to its origin of itself. You see the Hateful People. This is not a mistake.','Hold back for now. Keep your mind and heart warm and clear. Stay where you feel secure. Harmony and strength will return of themselves. You will find the spirit and intelligence to carry all before you. Gather energy for the decisive new move.',64),(224,38,2,1,'You meet the Hidden Lord of the Crooked Path. This is not a mistake.','In an unexpected way you meet someone or something of great importance. Let this influence enter your heart. Though you may feel your gifts are small, bite through the obstacles to union. Act from your heart. You can create a warm and inspiring atmosphere. Care for other people. Gather energy for a decisive new move.',21),(225,38,3,0,'You see your cart pulled back and your cattle hobbled, the Branded Man with his nose cut off. What you initiate will not be completed.','You tried to force your way through and met strong opposition. Nothing will come to fruition now. Stay where you are secure and re-dedicate yourself to what great. This will reverse what feels like an oppressive situation. Concentrate what you have and offer it to your highest ideals. Be resolute and part from the past. You are connected with a creative force.',14),(226,38,4,1,'Diverging alone. You meet the Primal Father, mingle and connect to the spirits. Adversity, the hungry souls and angry ghosts. This is not a mistake.','Though you are alone and isolated, you will soon encounter something truly inspiring. Join with this even if it is difficult. Cut through past pain and sorrow. Make sure your house is in order. This calls for honest repentance of past mistakes. The center of life is moving now and you are a part of it. You will soon find a real friend and lose a false one. Be open and provide what is needed.',41),(227,38,5,0,'The cause for sorrow disappears. You see the ancestors eating flesh. How could going on like this be a mistake?','Deep powers are reaching out to you to confer their energy and spirit. You will be returned to the flow like an animal led on a leash. Forget glory and achievement now and give openhandedly to those around you. Do not impose yourself.  Be decisive now and part from the past.  Step out to meet the new destiny. Gather energy for the decisive new move.',10),(228,38,6,1,'Diverging alone. You see Heavenly Swine covered with muck, the Chariot of Dead Souls. First you stretch the bow, then you loosen the bow. These you confront are definitely not outlaws. Seek a marriage alliance. Going on you meet the rain. Wise Words! The Way will open.','You see those around you as dirty pigs and old ghosts. Drop the hostility and seek an alliance. These are the first steps on the path to union. Stay within the security of your dwelling and count on the new connections. The old way is an empty womb. You can speak freely now for nothing is lacking. If you let yourself be led you can realize the hidden potential. Co-operate with the ongoing process of change.',54),(229,39,1,0,'Limping. Difficulties in going, praise and ease are coming.','Resist the temptation to push your way through. Brake your wheels. Let the past dissolve and gather energy for the decisive new move. Everything will benefit from this. You will eliminate a highly placed enemy who is oppressing you. Co-operate with the on-going process of change.',63),(230,39,2,0,'The King’s servant: Difficulties, Difficulties! His own person is definitely not the cause.','You are pushing on through a sea of troubles. Calm your heart. The difficulties you are facing are not your fault. You are held in an oppressive net of responsibilities by a corrupt authority. Have patience and hold on to what is of real worth. Bring the hidden to light. You will not only be liberated but acquire the ability to help others. Step outside the norms. Co-operate with the on-going process of change.',48),(231,39,3,1,'Limping. Difficulties in going, the reverse is coming.','Do not keep chasing what you want. If you wait calmly the whole situation will reverse itself. You will truly have cause to rejoice. You are grouped with the wrong people and think the wrong thoughts. The army must retreat now. Strip away the old connections. Splitting from what you depend on now will bring a real connection to the new.',8),(232,39,4,0,'Difficulties in going, the connection is coming.','You feel lonely and think the world is against you but you are beating your head against a brick wall. Your thoughts waver while things go and come, but have no fear. Hidden friends are following you. Your sorrows will soon disappear. Stabilize your heart and give real form to the gift you have received from the spirit. You are connected to a creative force.',31),(233,39,5,1,'In Great Difficulties, partners come.','Though you are in the middle of great difficulties have no fear. New partners will soon be there to help you. A hidden creative force is tearing through the obstacles to find you. The limits you have set yourself are turning you to stone. Seize the moment. Dissolve the obstacles to understanding. You can eliminate hidden enemies and acquire the ability to act decisively. Co-operate with the ongoing process of change.',15),(234,39,6,0,'Difficulties in going, ripeness and abundance are coming. Wise Words! The Way opens. Advantageous to see the Great People.','Do not try to impose your will. Simply let go and the situation will drop into your hand. Things are full of promise now. Talk to those who can connect you with what is great in the situation and in yourself. A new world is appearing. Use these signs of union. Now is the time to put things in order. Step out to meet the new fate. Deliverance is coming. Gather energy for a decisive new move.',53),(235,40,1,0,'Deliverance. This is not a mistake.','Act on your plans. You are in the right position. Difficulties are going, ripeness and abundance are coming. Talk to those who can connect you with what is great. Now is the time to put things in order. If you let yourself be led you can realize your hidden potential. Co-operate with the ongoing process of change.',54),(236,40,2,1,'You catch three foxes in the fields and acquire a yellow arrow. Wise Words! Trial: The Way is open.','You can catch the forces that seem to be threatening you and acquire the power to act decisively. Though you are in the midst of great difficulties, have no fear. New partners will soon be there to help you. A hidden creative force is tearing through the obstacles to find you. Do not even complete the day, for the limits you set yourself are turning you to stone. Gather energy for a decisive new move.',16),(237,40,3,0,'He bears a burden yet rides in a carriage. This attracts outlaws in the end. Trial: Distress.','You are tied to a false position, acting above or beneath yourself. Who you are trying to impress? Is it really worth it? If you go on like this you will be covered in shame. You think the world is against you but actually you are beating your head against a brick wall. Have no fear. Hidden friends are following you and your sorrows will soon disappear. Stabilize your heart and fix the real gift you have been given. Be resolute. You are connected to a creative force.',32),(238,40,4,1,'Loosen your thumbs. Partners will come in the end. Splitting apart brings a connection to the spirits that will carry you through.','Deliver yourself from your current connections. Do not keep chasing what you want. New friends will come after a time of loneliness. Have no doubt. Just wait calmly and the whole situation will reverse itself. Strip away the old and you will truly have cause to rejoice. Something significant is returning.',7),(239,40,5,0,'The Realizing Person’s tether is loosened. Wise Words! The Way opens. There is a connection to the spirits that reaches the Small People.','If you are truly committed to what you are doing you will be delivered from the constriction you feel. Hold fast to what you believe. Talented people without a leader will feel this and come to your aid. The difficulties you are facing are not your fault. You are held in an oppressive net of responsibilities by a corrupt authority while everyone seeks their own ends.  Seek out the hidden and bring it to light. Your patience and inner work will be rewarded. Step outside the norms and re-imagine the situation. Gather energy for a decisive new move.',47),(240,40,6,0,'The prince uses this to shoot a hawk on a high rampart above. He catches it. There is nothing that is not advantageous.','You can capture the forces opposing your plans. Have no fear. You will eliminate a highly placed enemy who is oppressing you. Difficulties are going, praise and ease are coming. Though you feel cut off, resist the temptation to simply push your way through. Open yourself to new thoughts and your frustrations will disappear.  Your patience and inner work will be rewarded. Gather energy for a decisive new move.',64),(241,41,1,1,'Complete this. Go swiftly. This is not a mistake. Discussing Diminishes it.','Make the connection quickly. Do not let discussion diminish your resolve. You have to correct a far-reaching error. Punish those who must be punished and set your spirit free. Do not sit there while weeping blood is coursing down all around you. Something significant is returning now. Be open and provide what is needed.',4),(242,41,2,1,'Advantageous Trial. Chastising closes the Way. Trap! This Diminishes nothing, it Augments it.','This is a very advantageous connection. Everyone will benefit. Do not try to discipline people or set out on an expedition. Shake up the source of nourishment. Reject the rules and clear the channels. You have a kind, generous heart and a noble spirit. Act through this virtue and kindness. You can create something that endures. Be open and provide what is needed.',27),(243,41,3,0,'When there are three people moving, they will be Diminished by one. When one person is moving, they acquire a friend.','If you are involved in a triangle, it will soon become a couple. If you are alone, you will soon have a friend. You are pursuing a great ideal. Do not lose heart. This drudgery will bring you profit and insight in the end. The center of life is moving and you are an important part of it. Putting your ideas to the trial lets you disentangle yourself from the past. If you let yourself be led you can realize the hidden potential. Co-operate with the on-going process of change.',26),(244,41,4,0,'Diminishing your affliction. Commission someone to carry it swiftly. There will be rejoicing. This is not a mistake.','This connection is seriously harming you. Diminish your involvement. Send someone quickly to give the message and you will soon have cause to rejoice. In your isolation you encounter a powerful friend who will help you. Make sure your house is in order. Honestly repent your past mistakes. What seems like an unfortunate happening will soon turn out to your benefit. The center is moving and you are part of it. Co-operate with the on-going process of change.',38),(245,41,5,0,'Someone Augments you. The Way to the Source is open. Ten pairs of tortoise divinations cannot control or contradict this!','This is a blessing and a message from above. Nothing can interfere with your plans and your desires. There is a hidden spirit calling to you, the call of the inner self. Do not hesitate to answer. This will bind you to others on a deep spiritual level. Be open and provide what is needed.',61),(246,41,6,1,'This sacrifice does not Diminish you, it Augments you. This is not a mistake. Wise Words! Trial: The Way is open. Advantageous to have a direction to go. You acquire servants, not dwellings.','You will not be diminished but augmented by this. It will bring good things to everyone involved. Have a plan. Be sure of yourself. You will get considerable help but this will not be a sedentary affair. You need a great idea around which you can organize your passion. Generosity and wealth are nearing. Be generous with what you acquire and all your desires will be fulfilled. It is definitely the right time to act. Something significant is returning.',19),(247,42,1,1,'Advantageous to arouse and activate the Great. Wise Words! The Way to the Source is open. This is not a mistake.','You need a great idea around which you can organize yourself and your passion. You will not be diminished but augmented by this. It will bring benefit to everyone involved. Draw up a plan and be sure of yourself. You will get help in mobilizing your energy. Be generous and all your desires will be fulfilled. Strip away old ideas.',20),(248,42,2,0,'Someone Augments you. Ten pair of tortoise divinations cannot control or contradict this! Wise Words! Trial: an ever-flowing Way. The King makes presentations to the Supreme Power. The Way opens.','This is a blessing, a mission from above. Anything you wish to do will prosper. This connection will bind you to others on a deep spiritual level. A hidden spirit is calling from the depths. Do not hesitate to answer. Be open and provide what is needed.',61),(249,42,3,0,'Augmented through service when the Way is closed. This is not a mistake. There is a connection to the spirits that will carry you through. The center is moving. Inform the prince. Use the jade baton.','What seems like an unfortunate happening will turn out to your benefit. The capital city is about to be moved and you are part of the process. Diminish your involvement with the old ways. Send someone quickly to give the message and you will soon have cause to rejoice. Honestly repent past mistakes. If you simply let things slide the connection will disintegrate. Gather energy for a decisive new move.',37),(250,42,4,0,'The center is moving.  Inform the prince and he will follow. Advantageous to participate in shifting the capital city.','This is a great change in the center of power. Stay loyal to your friends. Act on your ideas. You will soon gain a friend or lose an entangling triangle. You are pursuing a great ideal. Do not lose heart. This drudgery will bring you profit and insight in the end. Proceed step by step. Gather energy for a decisive new move.',25),(251,42,5,1,'You have a connection to the spirits and a benevolent heart. No question, the Way to the Source is open. A connection to the spirits will carry you through. Wise Words: A benevolent heart is my power and virtue.','You have a kind, generous heart and a noble spirit. Act through your virtue and kindness. Do not question this. Use it to create something that endures. Everyone will benefit. Do not discipline people or set out on an expedition now. Shake up the source of nourishment. Reject the rules and clear the channels. Do not step into the great stream of life until this is cleared up. Be open and provide what is needed.',27),(252,42,6,1,'This absolutely does not Augment you. If you try to order your heart without fixing this omen, Someone will smite you. Trap! The Way will close for you.','You receive a great sign but will not heed it. Nothing good can come of this. This is a warning you can heed if you will. Steady your emotions. Your involvement in melancholy feelings is a real mistake. You have to correct a far-reaching error, so punish those who must be punished and set your youthful spirit free. Do not just sit there weeping blood. Strip away your old ideas. Be open and provide what is needed.',3),(253,43,1,1,'Invigorating the leading foot. Going without overcoming them. Acting this way is a mistake.','If you try to take the lead you will most certainly fail. Prepare your move very carefully. The beginning is humble, but the result will be great. If you simply step into the deep waters around you now you will be submerged and drown. Let the distress you feel return you to yourself. Do not be afraid to act alone. You are coupled to a creative force.',28),(254,43,2,1,'Alarms and outcries. Bring it out. No rest at night. Stay under arms and have no cares.','This is a tense and invigorating situation with things coming from all sides. Stay alert. Bring out what is hidden and you will obtain what you want. A vision and a plan are emerging and a way to carry it into the world. What you do now can add elegance and beauty to life. You are coupled with a creative force.',49),(255,43,3,1,'Strong in their cheekbones. Trap! The Way closes for them. The Realizing Person goes on alone: Parting! Parting! He meets the rain, feeling soiled and indignant. This is not a mistake.','You are involved with cruel people intent only on their mastery. See this clearly and leave. You will be caught in a flood of abuse but this is not a mistake. You may think you see an interesting opportunity to communicate now but there is nothing in it. Subtly penetrate to the new situation and you will catch the game you really need. Co-operate with the on-going process of change.',58),(256,43,4,1,'Buttocks without flesh.  He limps haltingly, like an animal led on a leash. The cause for sorrow will disappear. When you hear people’s words, do not trust them.','You have been punished or hurt and feel isolated. See this as a gift from fate. Do not believe what people tell you and keep your own speech guarded. You are waiting in blood so get out of the cave. You need the power and the insight of the ancient sages. Take heart and fight your way through even though your social duties may suffer. Step outside the norms. Co-operate with the on-going process of change.',5),(257,43,5,1,'The mountain goat runs quickly! quickly! down the center of the road. This is not a mistake.','You face a stubborn problem and have to choose between two alternatives. Do not charge into obstacles. Retreat from your compulsions and you will see your true purpose emerge.  If you move quickly to part from the past your ideas will bear fruit. You need quiet and intimacy now. You are connected to a creative force.',34),(258,43,6,0,'Not announcing the omen. Trap! Completing things like this will close the Way.','If you do not communicate your message you will be cut off and isolated. The inspiring force retreats to the underworld waters. Do not keep pushing on blindly. Sacrifice your immediate desires and let your ideas circulate. You are connected to a creative force.',1),(259,44,1,0,'Attach this to the loom of change. Wise Words! Trial: The Way is open. Have a direction to go. See the Trap: An entangled pig balking at the sacrifice. There is a connection to the spirits that will carry you through.','Do not act this impulse out. See the trap inherent in the situation and accept the sacrifice of your immediate desires. If you do not truly register this important message you will be cut off and isolated. The inspiring force is retreating into the underworld waters. It will soon emerge again. You are connected to a creative force.',1),(260,44,2,1,'There are fish in the willow wrapping. This is not a mistake. Hospitality is not advantageous.','Stay quiet and withdrawn. Your ideas have borne fruit.  They need quiet and intimacy. Do not simply charge into obstacles. Make the decision and move quickly to the inner center. Turn your considerable strength into imagination. What is being born now is a purpose that belongs with you. You are coupled with a creative force.',33),(261,44,3,1,'Coupled with fate, buttocks without flesh. He limps haltingly. Adversity, the hungry souls and angry ghosts. Without the Great you will make a mistake.','You are isolated or hurt and are trying to move to a new place.  Believe in your central idea. Do not believe collective opinion and keep your own speech guarded. You are waiting in blood and must get out of this cave. Escape to your people’s doors, the place where you are welcome. When the distress ends friends will seek you out. Your sorrows will soon disappear. Gather energy for a decisive new move.',6),(262,44,4,1,'Coupling. No fish in the willow wrapping. Trap! Rising up to action closes the Way.','There are no creative possibilities in this. Objecting or rebelling will not help. You are involved with cruel people intent only on mastery. See this clearly. You might think that you see an interesting opportunity to communicate now, but if you open yourself you will be cut off and trapped. Subtly penetrate to a new situation. The cause for sorrow will disappear and you will catch the game you really need.  Step outside the norms. Co-operate with the on-going process of change.',57),(263,44,5,1,'Willow wrapping the melons, jade talisman in the mouth. Held in this containing beauty, it tumbles down from Heaven.','This is a beautiful inspiration, a new destiny. What you do now will add elegance and beauty to life, inaugurating a wonderful new time. Stay alert and let your past sorrows go. If you bring out what is hidden you will obtain what you want. This is your day. This can renew your creative life. Be resolute and part from the past. You are connected to a creative force.',50),(264,44,6,1,'Coupling with your horns. Distress. This is not a mistake.','You are turning this engagement into a trial of strength that leaves you totally confused. Let your confusion return you to yourself. If you try to take the lead now you will most certainly fail. Prepare your move very carefully. Do the inner work. Be simple, clear and pure. If you step into the deep waters surrounding you now you will be submerged and drown. Do not be afraid to act alone. You are connected with a creative force.',28),(265,45,1,0,'The connection to the spirits is not complete. Thus there is disorder, then gathering. Cry out! One grasp of the hand will bring laughter. Have no cares. Going on is not a mistake.','You are connected to a deep source of energy but the link with others is unclear. Leave your current position and mingle with the people. Reach out and the tension will dissolve. This is how you can achieve something great. Do not involve yourself with corrupt authority. Serve only the highest ideals. Do not pause in your efforts to eliminate discord. Proceed step by step. Gather energy for a decisive new move.',17),(266,45,2,0,'Extend the Gathering. Wise Words! The Way is open. There is a connection to the spirit that will carry you through. Advantageous to make the summer sacrifice.','This is a time for great things. You ostensibly have all you need but you feel cut off and oppressed. Make an offering. Return to the common source of human values and strengths and open your heart anew. You will soon find supportive friends. Gather energy for the decisive new move.',47),(267,45,3,0,'Gathering, then lamenting. No direction is advantageous. Going on is not a mistake. Being Small brings distress.','As soon as you begin to gather with others a flood of painful memories swamps you. There is nothing you can do so leave gently and quietly. If you try to adapt to this situation you will be covered in confusion. Hold onto your desire to follow things impulsively. There is no game in the field now. Dedicate your efforts to the real common good. Be open to new influences. You are coupled with a creative force.',31),(268,45,4,1,'The Great Way opens. This is not a mistake.','You can do anything you want now if you act with a full and loving heart.   You feel outside your present group but you are in this position because of your real moral and intellectual worth. Let go of old memories, useless ideas and false images. This is the moment to emerge. Strip away the past and set your forces in order. There is no resistance to your efforts. Be open and provide what is needed.',8),(269,45,5,1,'Gather them in ranks. This is not a mistake. You do not need to offer victims. Trial: An ever-flowing source. The cause of sorrow disappears.','This can be a long-term source of energy and inspiration. Simply gather the people and give them rank and position. Provide for this endeavor even if you feel afflicted or oppressed. Your efforts will call out to others. Step outside the norms and re-imagine the situation. Gather energy for a decisive new move.',16),(270,45,6,0,'Sighs and sobs, tears and moans. This is not a mistake.','Expressing your sorrow now can open blocked communication. Everything seems clogged up now but have no fear. You will soon have cause to rejoice. The obstruction you feel is toppling. It is time to get this great endeavor off the ground. Find people of worth you really belong with. Put things in order. Proceed step by step. Gather energy for a decisive new move.',12),(271,46,1,0,'Sincere Ascending. Wise Words! The Great Way opens.','You have been recognized. People have become aware of your value. Expressing your feelings now is not a mistake. The obstruction is toppling and you will soon have cause to rejoice. It is time to get this great endeavor off the ground. Put things in order. Find people of worth you really belong with. If you let yourself be led you can realize hidden potential. Co-operate with the ongoing process of change.',11),(272,46,2,1,'There is a connection to the spirits that will carry you through. Advantageous to make the summer sacrifice. This is not a mistake.','The connection is established. Dedicate yourself to what you believe in. You have a position in this gathering, a long-term source of energy and inspiration. Provide for this even if you feel afflicted or oppressed. Your efforts will call out to others. These goings and comings release the energy now bound up in the past.  Co-operate with the ongoing process of change.',15),(273,46,3,1,'Ascending through the empty city on the lower hill.','There is no resistance to your efforts. Push on. You may feel outside your present group but you are in this position because of your real moral and intellectual worth. Let go of old memories, useless ideas and false images. Come out of mourning and set your forces in order. Something significant is returning. Be open and provide what is needed.',7),(274,46,4,0,'The King sacrifices and receives blessing on the Twin-peaked Mountain. Wise Words! The Way is open. This is not a mistake.','Dedicate your efforts to the common good. Every time you tried to gather together with others a flood of painful memories swamped you. Hold onto your compulsive desire to follow or to collect followers now. Be resolute and part from the past. It will connect you with a creative force.',32),(275,46,5,0,'Ascend the steps. Wise Words! Trial: the Way is open.','Proceed step by step. There are no barriers to your progress. Though you ostensibly have all you need you feel cut off and oppressed by lack of recognition. Extend the gathering, include more. Return to the common source of value and feeling. Be resolute now and part from the past. You are connected to a creative force.',48),(276,46,6,0,'Ascending in a waning moon. Dim light. There will be changes. Advantageous not to pause in making the Trials.','Do not stop now. Pushing on will bring both profit and insight in the end. You are connected to a deep source of energy but the link with others is still unclear. Leave your current position and mingle with the people. Simply reach out and the tension will dissolve into laughter and joy. Do not involve yourself with corrupt authority. Serve the highest ideals. Let yourself be led and you can realize hidden potential. Co-operate with the ongoing process of change.',18),(277,47,1,0,'Buttocks punished with a wooden rod. If you enter the shadowy gully now, you will encounter no one for three years.','You have been hurt or punished but you are your own worst enemy now. Do not retreat into melancholy darkness. Put yourself in order. You can connect with the source of human values. If you stir up sorrow then there will be sorrowing. Have no fear. You will soon find supportive friends. Gather energy for a decisive new move.',58),(278,47,2,1,'Confined and Oppressed at food and drink. Scarlet sashes are coming on all sides. Advantageous to make presentations to your ideals. Chastising closes the Way. This is not a mistake.','You ostensibly have all you need but you feel oppressed by lack of recognition.  Help is on its way. Hold on to your ideals and extend the gathering. This will lead to great works. Climb the steps and open your heart anew. You can clear the source of common good. Proceed step by step. Gather energy for a decisive new move.',45),(279,47,3,0,'Confined and Oppressed by stones, you grasp the thorn-vines. You enter your palace and do not see your consort. Trap! The Way closes.','You are beating yourself against impossible obstacles, grasping at things that hurt you. You cannot even see your partner who is eager to help. The structure of your life is buckling. Do not be trapped in this pitfall. Sacrifice the old and let in the hidden connections. If you do not add more, your life will soon be crowned anew. Do not be afraid to act alone. You are connected to a creative force.',28),(280,47,4,1,'Confined and oppressed in a bronze war-chariot. It comes slowly, slowly. Distress. There will be completion.','You are confined by oppressive duties and burdensome thoughts. The solution to your problems will arrive slowly. It will take a change of heart to recognize it.  Do not be trapped in collective opinions. Sacrifice the old and let in the hidden bonds. The connection to the common source of value is disturbed. Move on and you can share your gifts. Be open and provide what is needed.',29),(281,47,5,1,'Your nose cut, your feet cut, Oppressed by the crimson sashes. Slowly this will be loosened. Advantageous to make offerings to your ideals.','You are being oppressed by corrupt authorities. As your bitter feelings loosen you will be set free. Concentrate on your ideals. Though you confront many difficulties, this is not your fault. The source of common value has been corrupted by those who seek only their own gain. Prepare yourself through inner work. These comings and goings release energy now bound up in the past. Co-operate with the ongoing process of change.',40),(282,47,6,0,'Confined and oppressed by trailing creepers, you trip on tree stumps. Say it like this: If you stir up the causes of sorrow, then there will be sorrowing. Chastising opens the Way.','This seeming oppression should not even bother you. If you sit around and lament, then all you will hear is lamentation. You are contesting for mastery in a corrupt situation and you simply cannot win. The source of common good is like an old neglected well. Activate your energy and accept the heavy going. You will find supportive friends. Prepare the decisive new move.',6),(283,48,1,0,'This Well is a bog. They do not drink here. This old Well is a pitfall that no creatures come to.','The sources of life are muddy and bogged down. Clear your feelings about others. Seek the common good. If you sit around and lament then all you will hear is lamentation. Do the inner work even if the going is heavy. If you contest for mastery you will surely lose. Let yourself be led and you can realize the hidden potential. Co-operate with the ongoing process of change.',5),(284,48,2,1,'This Well is a gully where people shoot fish. The jug is cracked and leaking.','The sources of life are not taken care of. Each seeks his own gain. Do you really want to act like this? Though you have been oppressed by a corrupt authority, let your bitter feelings dissolve. The endless difficulties you confront are not your fault. Prepare yourself through inner work and leave the past behind. These goings and comings will release the energy now bound up in the past. Gather energy for a decisive new move.',39),(285,48,3,1,'This Well is turbid. They do not drink here. This makes my heart ache. If the King made a covenant, we could share this blessing together.','This is the sorrow of someone who is connected to the source of the common good but has no one with whom to share it. You are confined by a host of oppressive duties and burdensome thoughts. Do not be trapped in this pitfall. Move on. Sacrifice the old and let in the hidden connections to the new. Have no fear. Gather energy for the decisive new move.',29),(286,48,4,0,'This Well is being lined with tiles.','This is a time for inner work and improvement. Do not beat yourself against impossible obstacles and grasp at things that can only hurt you. The structure of your life may buckle and fail, but if you do not add more to this painful situation it will soon be crowned anew. Have no fear. You are connected to a creative force.',28),(287,48,5,1,'This Well has cold, clear spring water to drink.','Your relations with others are a clear, pure source of life water for everyone to draw on. Use it and give thanks. Though you ostensibly have all you need you feel oppressed by lack of recognition. Do not worry. Help is on its way. Draw others in and make an offering to your common goals. Open your heart anew. If you let yourself be led you can realize the hidden potential. Co-operate with the ongoing process of change.',46),(288,48,6,0,'This Well receives and gives to all. Do not cover it. There is a connection to the spirits that will carry you through. Wise Words! The Way to the Source is open.','Receive and give freely. Do not hide this source of spiritual nourishment. You can accomplish great things. You may have been unfairly hurt or punished but do not retreat into melancholy darkness.  The time is changing and an opening draws near. Express yourself freely. Do not go any farther into the old dramas. Step outside the norms and re-imagine the situation. Co-operate with the ongoing process of change.',57),(289,49,1,1,'Tightly secured in the yellow bull’s skin.','You are held tight and cannot move for now but the inner work is going on. Feel the spirit moving and search for the vision of the new. Give it an enduring place in your heart. Do not be afraid to act alone. You are connected to a creative force.',31),(290,49,2,0,'This is your own day, so Skin it! Wise Words! Chastising opens the Way. This is not a mistake.','This is your time. You can change the world. Take vigorous action. Bring it out, even in adversity. Your new destiny will tumble down from above. Announce it. Be resolute and part from the past. You are connected to a creative force.',43),(291,49,3,1,'Chastising closes the way. Trap! Trial: Adversity, the hungry souls and angry ghosts. When the Skinning words pass round three times, you will be connected to the spirits.','This is not the time to discipline others. You are facing danger with roots in the past. Let go of simply adapting and release the power of your experience. If you co-operate with corrupt authorities now you will be swept away with them when the great change comes. Proceed step by step. Gather energy for the decisive new move.',17),(292,49,4,1,'The cause for sorrow disappears. There is a connection to the spirits that will carry you through. Changing Heaven’s Mandate. Wise Words! The Way is open.','This is your day. Act and have no doubts. Eliminate the old negativity. Everything may feel clogged up but have no fear. This is a transformation of your life in the most fundamental sense.  Strip away the old. Step out to meet the new destiny. Gather energy for the decisive move.',63),(293,49,5,1,'The Great Person makes a tiger transformation. Even before the omens are cast, there is a connection to the spirits.','Let your creative strength be seen. People will recognize you. You have received a real purpose from higher powers. This is substantial, so have no fear. Your enemies cannot harm you. You will soon acquire helpers. Do not be afraid to act alone. You are connected to a creative force.',55),(294,49,6,0,'The Realizing Person makes a leopard transformation. Small People put on a skin mask. Trap! Chastising closes the Way. Stay where you are. Wise Words! Trial: The Way is open.','Change with grace and elegance. Do not simply put on another mask. Stay where you are and gather the people for the new endeavor.  Accept the hard work and your sorrows will disappear. You must overturn things to clear the channels of communication. Step outside the norms and re-imagine the situation. These goings and comings will release the energy now bound up in the past. You are coupled with a creative force.',13),(295,50,1,0,'The Vessel’s overturned foot. Advantageous for clearing the obstruction. Harvesting. Acquiring a concubine for the sake of a son. This is not a mistake.','Turn things on their head to clear obstructions to communication. Mingle with the new spirit and accept the drudgery it entails. Gather the people to welcome what is emerging.  Be resolute and part from the past. These goings and comings release the energy now bound up in the past.  You are connected with a creative force.',14),(296,50,2,1,'There is food in the Vessel. My companion is afflicted but cannot approach me. Wise Words! The Way is open.','You have something real cooking within you. Those around you are full of criticism and distrust but they cannot harm you. When the time comes to change, change with it quickly. This is a transformation in the core of your being. Step outside the norms. These comings and goings release energy bound in the past. You are connected to a creative force.',56),(297,50,3,1,'The Vessel’s ears are skinned and movement hindered. The pheasant fat is not eaten. We are changing the Mandate of Heaven. Rain comes on all sides and lessens the cause of sorrow. Wise Words! Completing this change opens the Way.','Everything feels clogged up now but have no fear. This is the great change, the time to eliminate all the old negativity. The rain will come to wash away your sorrows. Act and have no doubts. You will soon have something great to celebrate. Strip away the old. Gather energy for the decisive new move.',64),(298,50,4,1,'The Vessel’s stand is severed. The prince’s meal is overthrown. His form soiled. The penalty will be death in chambers. Trap! The Way closes.','You are caught in a false position but inner work can change it. Let the new ideas go round three times before you act, then follow the new spirit joyously. Release the power of your experience. Do not simply adapt. If you co-operate with corrupt authorities now you will be swept away with them when the great change comes. Let yourself be led and you can realize the hidden potential. Co-operate with the ongoing process of change.',18),(299,50,5,0,'The Vessel has golden ears and bronze rings. Advantageous Trial.','This is a great vision of the new. Announce it. Find a way to bring it into the world. Take vigorous action to clear the way, even in the midst of adversity. Your new destiny will simply tumble down from above. You are coupled with a creative force.',44),(300,50,6,1,'The Vessel has jade rings. Wise Words! The Great Way opens. There is nothing for which this is not advantageous.','This can transform your life and be of real benefit to others. You experience the beginning of a great change in awareness and nothing can tear it away. Give this an enduring place in your heart and part from the past. You are connected to a creative force.',32),(301,51,1,1,'Shake comes, frightening! frightening! Then laughing words, shouting! shouting! Wise Words! The Way is open.','This is a profound shock. Everything is turned upside down. Do not call out for help now.  Cut through pride and complication and set the armies marching. If you meet people with generosity and care you can signal to your true kin. Step outside the norms. These goings and comings will release the energy bound up in the past. Gather energy for a decisive new move.',16),(302,51,2,0,'Shake comes bringing adversity, hungry souls and angry ghosts. A hundred thousand cowries lost. Climb the Nine Mounds. Do not pursue what has been lost. On the seventh day you will acquire it.','The fertilizing shock comes. You think you have lost something precious and are plagued by the remorse of the past. Do not grieve.  Look at things from an independent perspective. Everything you lost will return of itself. When this is complete nothing can stop you. Let yourself be led and you can realize the hidden potential. Co-operate with the on-going process of change. ',54),(303,51,3,0,'Shake reviving, Oh! Oh! Shake moves without a mistake.','The fertilizing shock rouses your dormant creative energy. In this time of abundance you can see only dimly. Though you have found a place to abide with goods and a position you know a greater mission awaits. Still your compulsive actions and you will see where the real motivating power lies. Do not be afraid to act alone. You are connected to a creative force.',55),(304,51,4,1,'Shake released from a bog.','Everything is bogged down. Release the fertile energy from this cloud of confusion.  The center of life is moving, so return to yourself and strip away your old ideas. Do not cut yourself in two, separating yourself from real and legitimate desires. The acrid smoke from this repression is smothering your heart. Push on. Something important is returning now.',24),(305,51,5,0,'Shake comes and goes. Adversity, the hungry souls and angry ghosts. Stay intent on your desire. Do not lose your purpose. There will be service.','The fertilizing shock comes and goes, bringing up old memories and quarrels.  Keep your mind on what you truly want to do and all will be well. You have made a connection that will lead to real excellence. You must deal with the corruption of nourishment and care now. Stop running after impossible desires. You cannot rescue your followers though your heart may ache for them. Step out to meet the new destiny. Gather energy for a decisive new move.',17),(306,51,6,0,'Shake twisting and turning! Observing, you are terrified: Oh! Oh! Trap! Chastising closes the Way. Shake is not in your body, but in your neighbor’s body. Be calm. This is not a mistake. There will be words about a marriage.','The fertilizing shock twists and turns, driving people around you into a frenzy. Stay aloof. Do not lock your understanding away in old patterns. Be brave and independent. When an impulse to action comes, try to hold back before it leads you into compulsive entanglements. This could become an ever-flowing source of profit and insight. Step outside the norms. These goings and comings release the energy bound up in the past. Gather it for a decisive new move.',21),(307,52,1,0,'Bind and open its feet. This is not a mistake. An ever-flowing and advantageous Trial.','When an impulse to action comes, hold back before it leads you into compulsive entanglements. This can change your whole life for the better. Be brave and independent. These goings and comings will release the energy now bound up in the past. Co-operate with the on-going process of change.',22),(308,52,2,0,'Bind and open its calves. You cannot rescue your following. My heart is not glad.','Though you can take this opportunity to stop running after impossible desires you cannot help others on the same course. Still yourself. A fertilizing shock comes and goes bringing up old memories and old quarrels. You must deal with the corruption of nourishment and care now. Do not run after impossible desires. Follow the new spirit for this can lead to real excellence. If you let yourself be led now you can realize the hidden potential. Co-operate with the on-going process of change.',18),(309,52,3,1,'Binding the loins, separating the spine. Adversity, the hungry souls and angry ghosts. Acrid smoke smothers the heart.','You are cutting yourself in two, separating yourself from real and legitimate desires. The acrid smoke from this repression smothers your heart. You must release the fertile energy from this cloud of repression and confusion. The center of life is moving. Strip away your old ideas. Something important is returning.',23),(310,52,4,0,'Binding and opening its trunk. This is not a mistake.','Calm and stabilize your heart. This lets you see where your real motivations lie. A fertilizing shock has roused your dormant creative energy. In this time of abundance you can see only dimly. Even though you have found a place to abide you know a greater mission awaits. Step outside the norms. Do not be afraid to act alone. These goings and comings will release the energy now bound up in the past. You are connected to a creative force.',56),(311,52,5,0,'Binding its jaws. The words have order. The cause for sorrow disappears.','If you restrain your speech what you say will have order and elegance. The fertilizing shock comes and you feel you have lost something precious. Do not grieve. Look at things from an independent perspective. Everything you lost will soon return of itself. Your creative energy will make contact with deep sources of energy.  When this is complete nothing can stop you. Proceed step by step. Gather energy for a decisive new move.',53),(312,52,6,1,'Generous at the boundary. The Way is open.','Meet people with generosity, honesty and care now and you will receive it in return. You have learned what you need to face your new life. Do not call out for help. Cut through pride and complication. Let your actions speak and you will signal to your true kin. These goings and comings release the energy bound up in the past. Co-operate with the on-going process of change.',15),(313,53,1,0,'Wild geese settle on the riverbank. Small Son encounters adversity. There are words. Nothing is lacking.','You encounter danger from the past but the creative energy to deal with it is there. Stay firmly enclosed in what supports you. Those who approach you now are not outlaws. Seek an alliance. Gather energy for a decisive new move.',37),(314,53,2,0,'Wild geese settle on the stone. Eating and drinking, feasting! feasting! The Way opens.','You find a secure place and a warm connection. Free yourself from all the old dramas. Acting things out now would be a trap. This is an omen of future happiness. Step outside the norms. These goings and comings will release the energy now bound up in the past. Co-operate with the on-going process of change.',57),(315,53,3,1,'Wild geese glide over the high plateau. The husband goes on campaign and does not return. The wife is pregnant and does not nurture a child. Trap! The Way closes. Advantageous to resist becoming an outlaw.','You have taken a wrong turn on the path to union. Things are falling apart in mutual recrimination. Firmly resist the temptation to become violent or withholding. Let everything come into view. Look at the origins and let that decide whether you will advance or withdraw.  Draw out the time and delay the hasty decision. Strip away your old ideas. Something important is returning.',20),(316,53,4,0,'Wild geese settle on the trees. Someone gives you a branch to rest on, the rafters of the house. This is not a mistake.','This is a resting-place after a great transition, a portent of future happiness. Retreat to rekindle the real love you feel for others. You are confronting a troublesome past experience. If you use force now you will only be entangled. Have patience. Open your heart anew. You will reverse what looks like a subservient position. You are coupled with a creative force.',33),(317,53,5,1,'Wild geese settle on the grave mounds. The wife is not pregnant for three years. Complete this and absolutely nothing can stop you. The Way is open.','Restrain and reflect on your words. Take an independent perspective.  Do not pursue what you feel is lost. It will return of itself when this is complete. These goings and comings release the energy now bound up in the past. Co-operate with the on-going process of change.',52),(318,53,6,1,'Wild geese glide over the high plateau and the ancient forest. Their feathers can be used in the great spirit-dances. The Way opens.','Difficulties are going, ripeness and abundance are coming. See those who can put you in touch with the great in yourself. You are in the right position to free yourself from the past and enter the new city. Step outside the norms. Gather energy for a decisive new move.',39),(319,54,1,1,'The Marrying Maiden with her sister-brides marries as a junior sister. A halting gait lets you tread. Chastising opens the Way.','You are in the junior position. Put yourself in order and correct the situation. Difficulties are going and abundance is coming. See those who can put you in touch with the great. These goings and comings release the energy now bound up in the past. Co-operate with the on-going process of change.',40),(320,54,2,1,'Those who squint can see. The Way opens to the mountain people hidden in the shadow.','Look at things from an independent perspective. This is the penultimate step. When this is complete nothing can stop you. You feel you have lost something precious but do not pursue it. It will return of itself. These goings and comings release the energy now bound up in the past. Step outside the norms. Gather energy for a decisive new move.',51),(321,54,3,0,'The Marrying Maiden as a servant. Watching her hair grow. She reverses this and marries as a companion bride.','You are in a subservient place. Have patience. In the end you will reverse things and gain the strategic position. You are confronting a troublesome past experience. Retreat to rekindle your love for people. This is a resting-place and a portent of future happiness. If you use force now you will only be entangled. You are coupled with a creative force.',34),(322,54,4,1,'The Marrying Maiden draws out the time. Delaying the marriage lets her find the right moment.','Forget about deadlines. You have taken a wrong turn. Resist the temptation to become violent or withholding. Let everything come into view. You must release yourself from old fixations by truly confronting the past. Look at the origins and let them decide whether you will advance or withdraw. Something important is returning. Be open and provide what is needed.',19),(323,54,5,0,'Great Ancestor gives the Maidens in Marriage. Leading Wife’s sleeves were not as fine as Junior Sister’s sleeves. Changes are coming. The Way opens.','This is a secure place on the path to union. Use it to find the hidden source of the old story full of sexual intrigue and domestic violence and free yourself from its grasp. Re-imagine the situation. You will find supportive friends. Gather energy for a decisive new move.',58),(324,54,6,0,'A woman carried a basket with nothing in it. A noble sacrificed a goat with no blood. No advantageous direction.','This situation is a barren womb. Leave this all behind you.  You will encounter danger from the past, but have no fear. The creative energy to deal with it is there. Those who approach you now are not outlaws. Seek an alliance. These goings and comings release the energy bound in the past. Co-operate with the on-going process of change.',38),(325,55,1,1,'Meeting your lord as an equal.  The ten day week. This is not a mistake. There is honor and reward in going.','You encounter someone or something that will change the course of your life. Hold onto the connection and go through all the steps. If you try to fly away now everything you care for will vanish. Be very small, very careful and very frugal. Do not be afraid to stand alone. You are connected to a creative force.',62),(326,55,2,0,'Abounding screens them. It is so dark at noon you see the Dipper, constellation of fates. Charge: If we go forward, we will know doubts and affliction. Response: You have a far-reaching connection to the spirit that will carry you through. The Way is open.','Although you feel isolated and unsure you have a profound link to deep energies that is working at a great distance to create new connections. Press on. You have found real excellence. You can complete your work now and be recognized. Be resolute. You are connected to a creative force.',34),(327,55,3,1,'Abounding veils them. The capital is so dark at noon we see only dimly. He breaks his right arm. This is not a mistake.','You see such extraordinary things that you lose the capacity to respond. This is not a mistake. The fertile shock is on the way. Still your compulsions and stabilize your heart. A greater mission lies ahead. These goings and comings release the energy now bound up in the past. Gather your resources for a decisive new move.',51),(328,55,4,1,'Abounding screens them. The capital is so dark at noon we see the Dipper, constellation of fates. He meets the Hidden Lord. The Way is open.','In your solitude you meet something that makes everything clear.  This is an extraordinary thing. Hold onto the connection. Reclaim your lost intelligence. People have confidence in you. This seeming disaster can mark a profound change to a new state of being. These goings and comings release the energy bound in the past. Co-operate with the on-going process of change.',36),(329,55,5,0,'He receives the Mandate, held in a containing beauty. There will be reward and praise. The Way opens.','You have the ability to usher in abundance. Rewards and praise will be showered on you.  Let your great creative strength be seen. Your inner ideas will brighten outer events. Though your companions are full of negative emotions they cannot harm you. Take care of those under you. You are coupled with a creative force.',49),(330,55,6,0,'The roof screens the Mourning Hut. Will he peep through the door, alone and cut off for three years? Trap! The Way closes.','Do not stay in mourning for the past. Break out of this trap! Grasp the changing time and act. If you set out on campaign now there will be excellent results. Do not be afraid to act alone. You are connected to a creative force.',30),(331,56,1,0,'The journey in fragments, cling! clang! You are split off from your place and grasp disaster.','Your journey is falling apart before it has begun because you are grasping at all the little details. Do you really want to act like this? Do not stay in mourning for the past. Your melancholy and pain are in danger of destroying you. Organize yourself and set off. There will be excellent results. You are connected to a creative force.',30),(332,56,2,0,'Approaching a rest house. Take care of your goods. You acquire a young vassal. Advantageous Trial.','You make a new friend who is willing to help you. Your inner pattern will brighten outer events for you have something real cooking within you. Your old companions are jealous but they cannot harm you. Be resolute and part from the past. You are connected to a creative force.',50),(333,56,3,1,'Burning down the rest house, you lose your young vassal. Adversity, the hungry souls and angry ghosts.','You destroy what you have found through violent passions. Try to understand this. It could mark a profound change to a new state of being. Reclaim your lost intelligence. You can find the force moving events and acquire the capacity to move with it. Your sorrows will vanish. These comings and goings release energy bound in the past. Prepare the decisive new move.',35),(334,56,4,1,'You find a place to abide, acquire goods and an emblem ax. “My heart is not glad”.','You have found a place to abide with responsibility and power but deep in your heart you know a greater mission awaits. You see such extraordinary sights that you lose the capacity to respond. A fertilizing shock will revive your creative energy, releasing the energy now bound up in the past. Co-operate with the on-going process of change.',52),(335,56,5,0,'The Sojourner shoots a pheasant, with one arrow it disappears. Bringing this to completion brings praise and a mandate.','You can complete the purpose of your journey with one try. This brings you praise and the chance to serve something great. Although you still feel isolated you have a link to deep energies working at a great distance to create new connections. Push on. You have found real excellence. You are coupled with a creative force.',33),(336,56,6,1,'The bird burns down its nest. The Sojourner first laughs, then cries out and sobs. He loses his cattle. Trap! The Way closes.','You are being careless and arrogant. Go on like this and everything you care about will vanish. Consider your attitudes very carefully. You have encountered something that can change the course of your life. If you hold onto the connection it will bring you honor and reward. If you fly away you will be cut off. You are connected with a creative force.',62),(337,57,1,0,'Advancing and withdrawing, act like a warrior. Advantageous Trial.','Make decisions firmly. Change directions as often as you need. If you look at what you are involved with, you will see that it connects with something larger than your personal desires. Extend the inspiration to all. These goings and comings release the energy bound up in the past. Co-operate with the on-going process of change.',9),(338,57,2,1,'Subtle Penetration beneath the bed. Use diviners and intermediaries in great number. The Way opens. This is not a mistake.','Penetrate to the core of this old dark story and free yourself from its grasp. Use advisors who can sense past and future potentials. Changes are coming. Strip away the outmoded. Have no fear. Step out to meet the new destiny. Gather energy for the decisive new move.',53),(339,57,3,1,'Repeated Penetration, urgent and pressing. Distress.','You are pushing too hard. Do not be caught by your desperate need to express yourself or your desire for control. Simply separate yourself from all contention and you will soon have cause to rejoice. Take in the lessons of the past. Be open and provide what is needed.',59),(340,57,4,0,'The cause for sorrow disappears. In the field the King catches three kinds of game.','You have arrived at a position to influence things.  Realize that your old situation is a barren womb. Part from these cruel people who are intent only on mastery. Though your indignation about the past is justified do not be afraid to go on alone. The rain will soon come to wash away your sorrows. You are coupled with a creative force.',44),(341,57,5,1,'The Way is open. Lay out the offerings. The cause for sorrow disappears. Nothing not advantageous. Do not initiate something, complete it. Before seedburst, three days; after seedburst, three days. Your work will be rewarded.','Make an effort and everything will benefit. Do not initiate things, go through with what you started. Watch everything carefully before and after it has begun. Do not involve yourself in corruption. Honor only the highest ideals. Let yourself be led and you can realize hidden potential. Co-operate with the on-going process of change.',18),(342,57,6,1,'Subtle Penetration beneath the bed. He loses his goods and emblem ax. Trap! The Way closes.','This is not the time to penetrate the past. You will lose your position and all you care for. Do not be caught in your melancholy. There is a source of real life-water in your relation to common humanity. Expect real harmony to develop. These goings and comings will release the energy now bound up in the past. Step outside the norms. Co-operate with the on-going process of change.',48),(343,58,1,1,'Harmonious Opening. The Way is open.','Open yourself to this influence and expect real harmony to develop. If you get caught up in the old dramas you will lose your position and all you care for. There is a source of real energy in your connection with common needs and common feelings. Do not try to cover it up. You will soon find supportive friends. Gather energy for a decisive new move.',47),(344,58,2,1,'A connection to the spirit will carry you through. The Way is open. The cause for sorrow disappears.','Open yourself to this influence and it will open a whole new world. Connect with others. Complete what has been started. You must confront the corruption of authority. Use praise to accomplish your task. You disarm your opponents and reclaim your own intelligence. Let your sense of position dissolve. Proceed step by step. Gather energy for a decisive new move.',17),(345,58,3,0,'Coming Opening. Trap! The Way closes.','This may look like an interesting opportunity but there is nothing in it. This situation is a barren womb. Part from these people intent only on their own mastery. Subtly penetrate to the new you will achieve everything you desire. Do not be afraid to go on alone. Be resolute and part from the past. You are connected to a creative force.',43),(346,58,4,1,'Opening, bargaining words. No peace yet. Separate from the contention and there will be rejoicing.','You are discussing this opportunity and everyone’s temperature is rising. Simply separate yourself from all the contention and this will become a source of joy. Do not be caught in your desperate need for control. Dissolve your old identity and articulate the new time peacefully. Be open and provide what is needed.',60),(347,58,5,1,'A connection to the spirits will carry you through. Strip away the outmoded. There will be adversity, the hungry souls and angry ghosts.','This is a dangerous and exciting opportunity. Strip away your old ideas and face the challenge. Penetrate to the core of this old dark story and free yourself from its grasp. Changes are coming, an omen of great future happiness. If you let yourself be led you can realize the hidden potential. Co-operate with the on-going process of change.',54),(348,58,6,0,'Prolong the Opening. Draw out the words. Extend the joy and pleasure.','Extend the opening and possibility for connection. This could be a lasting source of joy and pleasure.  Do not be timid. If you look at what you are doing you now will see that it connects with something larger than personal desires. Step out to meet the new spirit. You will soon find supportive friends. Gather energy for a decisive new move.',10),(349,59,1,0,'Use the strength of a horse to rescue this. Invigorating strength opens the Way.','This affair is in trouble and you must come to the rescue. Do not take on other people’s problems. Harsh measures and bitter words do nothing but harm. Give it up. The cause for sorrow disappears. Be open and provide what is needed.',61),(350,59,2,1,'Leave what supports you and flee to the hidden triggers of change. The cause for sorrow disappears.','Let go of what you habitually depend on and activate your creative spirit. This will bring clarity and disperse the obstacles. Take the woman’s perspective now, watching from hiding. The knowledge of a great leader is nearing. Articulate your thoughts with sweetness and grace and you will meet with honor. Strip away your old ideas. Be open and provide what is needed.',20),(351,59,3,0,'Dispersing the obstacles. The cause for sorrow disappears.','Do not identify with your need to express yourself or your craving for personal power. Focus entirely on the needs of the work at hand. There is an opening now, but everyone is striving for their own ends. Separate from this and you will have cause to rejoice. Articulate your ideas quietly.  If you let yourself be led you can realize the hidden potential. Co-operate with the on-going process of change.',57),(352,59,4,0,'The Way to the Source opens. Disperse the ordinary and go to the hilltop shrine. You are not in hiding. This is a place to ponder what you would not ordinarily think.','Let go of the flock of thoughts that usually surround you. Find a place to ponder things deeply. You have a great opportunity and you need to see it clearly. Do not appeal to authority. A new mission is coming. The situation will deteriorate at first but have no fear. Consider things carefully. Articulate real needs. Gather energy for a decisive new move.',6),(353,59,5,1,'Dispersing sweat, a King’s command. This is not a mistake.','You are involved in a great project. Work hard to disperse the obstacles. Envelop your youthful impulsiveness. There are hidden processes at work that will ripen the situation. Those you confront are not outlaws. Seek an alliance. It will be a while before this bears fruit but in the end nothing can stop you. Take in the lessons of the past. Be open and provide what is needed.',4),(354,59,6,1,'Disperse the bad blood. Leave it, send it away, then come forth. This is not a mistake.','Remove any cause for conflict. Send it far away. You can emerge into the light and have the place you deserve. If you stay trapped in negative feelings you will be judged and punished. Stay in the inner center and contemplate what is truly important. Take in the lessons of the past. Be open and provide what is needed.',29),(355,60,1,1,'Do not come out of the inner door and chamber. This is not a mistake.','Stay in your place and contemplate what is truly important. Get rid of the causes for conflict and you can emerge and find the place you deserve. Do not enter the tomb of hidden rage. Take in the lessons of the past. Be open and provide what is needed.',29),(356,60,2,1,'Not coming out of the outer gate and chamber. Trap! The Way closes.','You are involved in a great project. Work hard to disperse the obstacles to achievement. There are hidden processes at work. You have been reaching out to people then turning away. Those you confront are not outlaws. Seek an alliance. It will be a while before the connection bears fruit but in the end nothing can stop you. Strip away your old ideas. Be open and provide what is needed.',3),(357,60,3,0,'If it is not like Articulating, it will be like lamenting! This is not a mistake.','Consider things carefully. Let go of the flock of thoughts that usually surrounds you. You have a great opportunity and you need to see it clearly. Find a place to ponder things deeply and the new will come shining through. Do not appeal to authority. Re-imagine the situation. These comings and goings release the energy now bound up in the past. Co-operate with the on-going process of change.',5),(358,60,4,0,'Quiet Articulating, peaceful and secure. Make an offering and you will succeed.','Articulate your ideas quietly and you will meet a warm response. Do not identify with your need to express yourself or your craving for personal power. Focus entirely on the needs of the work. There is an opening now, but everyone is striving for their own ends. Simply separate yourself from this and you will have cause to rejoice. Gather energy for a decisive new move.',58),(359,60,5,1,'Sweet Articulating. The Way is open. Going on like this brings honor.','Articulate your thoughts with sweetness, grace and delight. Let go of what you habitually depend on. Take the woman’s perspective, watching from hiding to catch a sight of the new. The knowledge proper to a great leader is nearing now. Your sorrows will disappear. Something important is returning.',19),(360,60,6,0,'Bitter Articulating. Trap! The Way closes. Repent this and sorrow disappears.','You want to impose harsh measures. You will do nothing but harm. Give up your bitterness and the cause for sorrow will disappear. This affair is in trouble and you must come to the rescue. Stay grounded.  Do not take on other people’s problems. If you soar away you will fall into the hunter’s net. Take in the lessons of the past. Be open and provide what is needed.',61),(361,61,1,1,'Let the mourners go home. If strangers come do not feast them. The Way opens.','Stay alone and quiet. If you are always worrying about other people you will have no peace. Disperse your old identity and the sorrows it implies. You will encounter someone or something that can change the course of your life. It will bring you honor and reward. Stay humble. Be open and provide what is needed.',59),(362,61,2,1,'A Calling Crane hidden in the shade Its offspring respond in harmony. I have a winged wine vessel. Come to me and I will simply pour it out.','This is the profound call of one soul to another and the call of the inner self, an ever-flowing source of energy. Persevere in this and your sorrows will disappear. Stay humble. Identify with the mothers and the servants, not the fathers and the leaders. Strip away your old ideas. Be open and provide what is needed.',42),(363,61,3,0,'Sometimes we drum, sometimes we stop. Sometimes we weep, sometimes we sing.','You find an equal and a rival, something to love and fight with. Imagine this difficult situation as a time when you meet the new spirit. Leave the quarrels behind and come together. Do not be skeptical about this and do not hold back. Do not carry on in the violent old ways. These goings and comings release the energy bound up in the past. Co-operate with the on-going process of change.',9),(364,61,4,0,'Changes are coming. The Moon is almost full. The horse’s yoke-mate disappears. This is not a mistake.','Your usual connections disappear. Preserve your integrity by cutting through pride and complication. Look at the dangers you have just passed through and let them be a warning. Do not be afraid to act alone. These goings and comings release the energy bound in the past. Prepare the decisive new move.',10),(365,61,5,1,'A connection that binds us together. This is not a mistake.','You can truly help people now. Act energetically. The hidden spirit is augmenting you. This is a deep influence that will endure and manifest over time. It will open up a whole new life. Something important is returning. Be open and provide what is needed.',41),(366,61,6,1,'A soaring sound, wings mounting to Heaven. Trap! The Way closes.','You are overreaching yourself, a disaster from within and without. Ask yourself why you are doing this. Do not be bitter about the past. Stay low, small and humble. Take this in and you can articulate a new time. Be open and provide what is needed.',60),(367,62,1,0,'You are acting like a bird that flies away. Trap! The Way closes.','Stay low, humble and grounded. Do not take on other people’s problems. Disperse your old identity. If you fly away now you will surely regret it. Use your strength to rescue what is important. You will encounter someone who can change the course of your life. It will bring you honor and reward. You are connected to a creative force.',55),(368,62,2,0,'Pass by your Grandfather, meet your Grandmother. Do not extend to the Leader, meet the Servant. This is not a mistake.','Do not push yourself forward. Identify with people in secondary roles. The connections you make now have a deep, enduring value. This hidden energy will augment you. A hasty move now leads to nothing but trouble. You are connected to a creative force.',32),(369,62,3,1,'You cannot Exceed defending yourself. If you carry on, you may be killed. Trap! The Way closes.','You are overextending yourself. You are in real danger, cycling through endless arguments in an escalating spiral. Re-imagine this situation. Leave old quarrels behind so that new life can enter the world. Do not be skeptical and do not hold back. These goings and comings release energy bound up in the past. Gather the resources for a decisive new move.',16),(370,62,4,1,'This is not a mistake. You do not pass by, you meet it. Let the adversity you experienced be a warning. Do not use it in a long-term Trial.','The transition is made. Take a look at the dangers you have just passed through and let them be a warning.  Let go of your old connections. Demonstrate your inner worth by cutting through pride and complication and everything will benefit. These goings and comings release the energy now bound up in the past. Co-operate with the on-going process of change.',15),(371,62,5,0,'Shrouding clouds bring no rain yet. It comes from our western outskirts. A prince uses a string-arrow to grasp another in a cave.','You make an enduring connection with someone who is in retreat. This hidden spirit will augment you. This is a deep influence that will endure and manifest over time. All cause for sorrow will disappear. You are connected with a creative force.',31),(372,62,6,0,'You do not meet it, you pass it by. The flying birds scatter and are trapped. Trap! The Way closes. This is called a disaster and a blunder.','You overreach yourself, flying higher and higher, a disaster from within and without. Change now. You must let go of the sorrows that impel this flight. Help and nourish others. Make no mistake, if you fly away all your connections to life will vanish. If you can disperse this old identity you will be able to articulate a new time. You are connected to a creative force.',56),(373,63,1,1,'Braking his wheels. Trailing her cord in the water. The Small Fox soaks its tail. This is not a mistake.','You have a great connection but are starting too quickly. Hold back. Let yourself be lured on.  Difficulties are going, praise and ease are coming. If you pull back and join with others now you can capture the oppressive force opposing your plans. You will soon have something to celebrate. Gather energy for the decisive new move.',39),(374,63,2,0,'A lady loses her jade hairpin.  Do not pursue her. On the seventh day she will return.','It seems like what you hope and care for is lost. Do not chase it. When the time comes it will return of itself. Keep your eye on what is important and do not listen to all those chattering voices. You have the chance to present your case before a real authority. This will let your sincerity shine through. These goings and comings release energy bound in the past. Co-operate with the on-going process of change.',5),(375,63,3,1,'The High Ancestor subjugates the Demon Country. Three years go by and he controls it. Small people should not use this.','You are embarked on a great enterprise. Keep a firm purpose. Do not listen to what others tell you, confining  your youthful spirit in a prison of outmoded thoughts. If you follow old desires you will lose yourself. Eliminate the negativity. Be open and provide what is needed.',3),(376,63,4,0,'Clothes in tatters. The wadded silk is soaked. Be careful till day is done.','You are in the middle of an important passage. Be vigilant. Everything may feel clogged up now but have no fear. You are on the edge of the great move. What you are beginning will bring all you want. You are coupled with a creative force.',49),(377,63,5,1,'The Eastern neighbors slaughtered many cattle. The summer sacrifice of the Western neighbor was not like this When they received the great blessing.','Do not try to impress people. Sincerity and dedication are what count now. You must pretend to be part of this situation even as it is falling all around you. If you restrain your eager desires for fame and recognition you can acquire all you want. Let yourself be lured into action. These goings and comings will release the energy now bound up in the past. Co-operate with the on-going process of change.',36),(378,63,6,0,'You soak your head. Adversity, the hungry souls and angry ghosts.','You have let yourself fall into old negativity. Why go on like this? You have the spirit and intelligence to carry all before you. You are facing the hateful people within yourself. Do not let them poison your heart. Let the distress you feel return you to the flow. Harmony will return of itself. Gather energy for the decisive new move.',37),(379,64,1,0,'Soaking your tail. Distress.','You have let yourself fall into the river of past pain. Why go on like this? You have the spirit and intelligence to carry all before you. Realize that you are facing the hateful people within yourself and do not let them poison you. If you bring this to completion harmony will return of itself. These goings and comings release energy bound in the past. Co-operate with the on-going process of change.',38),(380,64,2,1,'Braking his wheels. Trailing her cord in the water. Wise Words! Trial: The Way opens.','Everything is loaded but do not start yet. Let yourself be lured into action. The sincerity of your feeling and your dedication are what count. You have to pretend to be part of this situation even as it is falling all around you. Restrain your eager desires for fame and recognition. These goings and comings will release the energy now bound up in the past. Gather yourself for a decisive new move.',35),(381,64,3,0,'Chastising closes the Way. Advantageous to step into the Great Stream.','Do not try to discipline people or set out on an expedition. What you are doing now will bring all you want. You are in the middle of an important passage. Do not relax yet. Be resolute and part from the past. You are connected to a creative force.',50),(382,64,4,1,'Trial: The Way is open. Wise Words! The cause of sorrow disappears. The Shake subjugates the Demon Country. In three years there will be celebrations in the great city.','Arouse your energy and let go of the past. You are embarked on a great enterprise. If you simply follow old desires and impulses now you will be lost. Do not confine your youthful spirit in the prison of outmoded desires and thoughts. This will take time to complete but you will win in the end. Something significant is returning. Be open and provide what is needed.',4),(383,64,5,0,'Trial: The Way is open. Without a cause for sorrow. This is the Realizing Person’s shining. There is a connection to the spirits that will carry you through. Wise Words! The Way is open.','Act on your plans. Your sincerity shines through. Do not pursue what seems lost.  When the time comes it will return of itself. Keep your eye on what is important and present your case. Gather energy for a decisive new move.',6),(384,64,6,1,'There is a connection to the spirits through drinking spirits. This is not a mistake. Soak your head. There is a connection to the spirits in letting go of what is past.','You have a great connection but start slowly. Let yourself be lured on. Difficulties are going, praise and ease are coming. Pull back and join with others and you will capture the force opposing your plans and desires. There is nothing that will not benefit. These goings and comings release the energy now bound up in the past. Cooperate with the on-going process of change.',40);
